DROP TABLE public.exercises;
CREATE TABLE public.exercises (id SERIAL NOT NULL, name TEXT, description TEXT, springs TEXT, photo TEXT, video TEXT, createdAt TIMESTAMP(6) WITH TIME ZONE NOT NULL, updatedAt TIMESTAMP(6) WITH TIME ZONE NOT NULL, PRIMARY KEY (id));
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (10, 'Pelvic Curl Single Leg', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels on foot bar. Spine neutral. Arms by sides. Head rest down.&nbsp;One leg at table top.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale move through imprint, curl tail bone to pubic bone, pubic bone to navle roll up 1 vertebra at a time to T6.</p>
<p><br></p>
<p><em><strong>NOTE </strong></em><em><strong>&nbsp;Kepp table top legs shin parallel to the roof.&nbsp;</strong></em><em><strong>&nbsp;Be sure not to roll into spine extension. Sink the sternum lift the Pubic Bone.&nbsp;</strong></em></p>
<p><em><strong>Use the light spring setting for more hamstring connection, heavy spring for focus on spine articulation.</strong></em></p>
<p><u><em><strong>In technique class use 3 RED </strong></em></u>&nbsp;</p>', '3 RED or 1 BLUE In technique class use 3 RED ', null, '', '2018-03-22 10:07:56', '2018-03-22 10:07:56');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (6, 'Imprint Single Leg', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels on foot bar. Spine neutral. Arms by sides. Head rest comfortable. Float one leg up to table top.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u><u>&nbsp;</u></p>
<p>Inhale neutral spine and pelvis. Exhale imprint lumbar spine into the mat with single leg lifted in table top.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Can be done on the mat or reformer</strong></em></p>', '3 RED or 1 Blue', null, '', '2018-03-22 06:03:34', '2018-03-22 06:03:34');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (53, 'Kneeling Arms Side Series Straight Arm Side Lift ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling towards the side of carriage. Knees pelvis distance apart. Spine and pelvis neutral. Strap in hand closest to foot bar.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise&nbsp;</strong></u></p>
<p>Arm straight by side. Exhale adduct arm to shoulder hight.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Regression sitting on Long Box&nbsp;</strong></em></p>', '1 BLUE or 1 RED + ', null, '', '2018-03-28 04:01:11', '2018-03-28 04:01:11');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (68, 'Mermaid with Rotation ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Z sit on carriage facing sidewards. Hand on Foot bar forward of the centre of bar. Other arm outstretched.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale to prepare. Exhale press hand into Foot bar as out stretched arm arcs up and over. Spine comes into lateral flexion bring hand to foot bar and spine into rotation. Add arm presses. &nbsp;Inhale into top lung. Exhale return to starting position.&nbsp;</p>', '1 RED', null, '', '2018-03-29 12:12:18', '2018-03-29 12:12:18');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (74, 'Matadore ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling side facing on carriage. Knee closest to foot bar against shoulder rest other foot on frame 90/90 flexion at hip and knee. Arms crossed at shoulder hight.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press foot into frame and knee into shoulder. Adduct knee to centre line.&nbsp;</p>
<p><br></p>
<p><br></p>', '1 BLUE ', null, '', '2018-03-29 12:39:15', '2018-03-29 12:39:15');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (54, 'Kneeling Arm Side Series Draw a Sword ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling towards the side of carriage. Knees pelvis distance apart. Spine and pelvis neutral. Strap in hand closest to foot bar.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>&nbsp;Strap in hand closest to foot bar. Fist at opposite hip draw the sword Diagonally up across chest untill elbow is extended.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Variation add rotation. Can sit on Long Box&nbsp;</strong></em></p>', '1 BLUE or 1 RED+', null, '', '2018-03-28 04:07:58', '2018-03-28 04:07:58');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (61, 'Kneeling Arm Series Hug a Tree', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling facing foot bar. Toes against shoulder rests. Spine and pelvis neutral. Hands in straps elbows slightly flexed shoulder distance apart (1st position)</p>
<p><br></p>
<p><u><strong>The Excersise</strong></u></p>
<p>Inhale open arms out to side finger tips stay infront of shoulders 2nd position. Exhale return to 1st position.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Sit on Long Box for variation.&nbsp;</strong></em></p>', '1 BLUE or 1 RED ', null, '', '2018-03-28 04:56:25', '2018-03-28 04:56:25');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (69, 'Mermaid with Rotation and Extension ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Z sit on carriage facing sidewards. Hand on Foot bar forward of the centre of bar. Other arm outstretched.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale to prepare. Exhale press hand into Foot bar as out stretched arm arcs up and over. Spine comes into lateral flexion bring hand to foot bar and go into spine rotation and extension. Inhale into top lung. Exhale return to starting position.&nbsp;</p>', '1 RED ', null, '', '2018-03-29 12:20:14', '2018-03-29 12:20:14');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (75, 'Rowing Back Series Round Back ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting tall on carriage legs long through shoulder rests.</p>
<p>&nbsp;</p>
<p><u><strong>The exercise</strong></u></p>
<p>Elbows wide fists together at heart.&nbsp;</p>
<p>Inhale to prepare. Exhale roll back into long C curve. Inhale press arms out to side palms back. Exhale press hands together at back as head comes towards needs. Roll arms around to dead swan Stack spine back up to starting position.&nbsp;</p>', '1 RED ', null, '', '2018-03-29 12:46:25', '2018-03-29 12:46:25');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (39, 'Abdominal Series Scissors ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Reach arms to roof.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise&nbsp;</strong></u></p>
<p>Exhale chest left extend straight legs to L shape switch legs through scissors. Stay in chest lift.&nbsp;</p>', '1 RED, 1 BLUE', null, '', '2018-03-26 05:19:44', '2018-03-26 05:19:44');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (15, 'Footwork Toes Parallel', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Toes on foot bar. Spine neutral. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press toes into foot bar to extend knees. Maintain Neutral Spine.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Optional add pulses.&nbsp;</strong></em></p>', '3 RED +', null, '', '2018-03-22 10:31:42', '2018-04-01 15:02:38');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (7, 'Single Leg Lifts ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Supine. Heels on lowered foot bar, mat or a long box on the mat. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale connect to core lift single leg to table top maintain neutral spine. Inhale lower leg. Alternate legs.&nbsp;</p>', '3 RED or 1 BLUE  or MAT ', null, '', '2018-03-22 06:13:13', '2018-04-02 17:59:05');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (55, 'Kneeling Arm Side Series Side Triceps ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling towards the side of carriage. Knees pelvis distance apart. Spine and pelvis neutral. Holing hand strap.Strap in hand closest to foot bar other hand on shoulder rest spine in lateral flexion like kneeling mermaid. Hand with strap at crown palm up.</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale extend elbow.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Can sit on a Long Box</strong></em></p>', '1 BLUE or 1 RED ', null, '', '2018-03-28 04:11:10', '2018-03-28 04:11:10');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (62, 'Kneeling Arm Series Kneeling Triceps ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling facing foot bar. Toes against shoulder rests. Spine and pelvis neutral. Holing hand straps ir foot straps. Palms facing out finger tips at 3rd eye&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale press diagonally up as elbows extend. Inhale connect core on eccentric contraction. Lean body into the tension of the straps.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Sit on box for variation.&nbsp;</strong></em></p>', '1 BLUE or 1 RED ', null, '', '2018-03-28 04:59:56', '2018-03-28 04:59:56');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (70, 'Kneeling Shoulder Press Elbows Down ', '<p><u><strong>Set up</strong></u></p>
<p>Active childs pose. Hands on Foot bar. Elbows down, fingertips to celiling.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale draw core away from thighs press hands into Foot bar to extend elbows into tricep press.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Regression is to lye on a Long Box&nbsp;</strong></em></p>', '1 RED ', null, '', '2018-03-29 12:25:46', '2018-03-29 12:25:46');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (63, 'Stomach Massage Round back ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting on the bottom edge of carriage. Toes in V on foot bar. &nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Forward flexion C curve of the spine. Holding bottom of carriage. Inhale prepare. Exhale deepen core connection press toes into foot bar to extend the knees. Inhale return to start.&nbsp;</p>', '1RED +  ', null, '', '2018-03-28 05:11:16', '2018-03-28 05:11:16');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (34, 'Hands in Straps Triceps ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Arms beside side, palms down.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Bring elbows to a 90 degree angle and press back to starting position.</p>
<p><br></p>
<p><em><strong>NOTE Come into chest lift if client is able to maintaion good neck stability, shoulder alignment and core control.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED decrease springs if there is neck tension. ', null, '', '2018-03-23 10:28:11', '2018-03-23 10:28:11');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (71, 'Kneeling Shoulder Press Elbows Wide ', '<p><u><strong>Set up</strong></u></p>
<p>Active childs pose. Hands wide on Foot bar. Elbows wide, fingertips to eachother.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale draw core away from thighs press hands into Foot bar to extend elbows.</p>
<p><br></p>
<p><em><strong>NOTE Regression is to lye on a Long Box&nbsp;</strong></em></p>', '1 RED ', null, '', '2018-03-29 12:30:14', '2018-03-29 12:30:14');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (5, 'Imprint ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels on foot bar. Spine neutral. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u><u><strong> &nbsp;</strong></u></p>
<p>Inhale neutral spine and pelvis. Exhale imprint lumbar spine into the mat.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Can be done on the </strong></em><em><strong>mat</strong></em><em><strong> or </strong></em><em><strong>reformer</strong></em></p>', '3 RED or 1 BLUE ', null, '', '2018-03-22 06:02:09', '2018-03-22 06:02:09');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (4, 'Neutral Spine ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels on foot bar. &nbsp;Arms by sides. Head rest comfortable.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u><u>&nbsp;</u></p>
<p>Feel spine long, allow the natural curves of the spine to be present. The ASIS and Pubic Bone align. Release low ribs, widen the collar bones. Exhale connect core without changing spine and pelvic alignment.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE This can be done on the mat or the reformer.&nbsp;</strong></em></p>', '3 RED ', null, '', '2018-03-22 05:57:33', '2018-03-22 05:57:33');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (64, 'Stomach Massage Flat Back ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting on the bottom edge of carriage. Toes in V on foot bar. &nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Lengthen spine into active neutral, or as close as possible. Reach arm diagonally up. Exhale deepen core connection press toes into foot bar to extend the knees. Inhale return to start.&nbsp;</p>', '1 RED + ', null, '', '2018-03-28 05:23:51', '2018-03-28 05:23:51');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (72, 'Kneeling Shoulder Press Single Arm ', '<p><u><strong>Set up</strong></u></p>
<p>Active childs pose. SIng hands on Foot bar closer to center. Elbows down or wide.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale draw core away from thighs press hand into Foot bar to extend elbow.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Press other hand into bed to counter ballance the shoulders.&nbsp;</strong></em></p>', '1 BLUE or 1 RED +', null, '', '2018-03-29 12:32:45', '2018-03-29 12:32:45');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (57, 'Kneeling Arm Series Chest Expansion ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling facing shoulder rests.Wrap toes around bottom of carriage. Spine and pelvis neutral. Holing hand straps.&nbsp;</p>
<p>Tension on the straps arms are by the mid side.</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale press the arms back into shoulder flexion. HOLD breath in look left right. Inhale return arms to start.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Bet mindful of losing balance with heavier springs. To regress sit on a Long Box.&nbsp;</strong></em></p>', '1 BLUE or 1 RED +', null, '', '2018-03-28 04:35:34', '2018-04-01 15:01:06');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (56, 'Kneeling Arm Series Rotation Pull ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling facing shoulder rests.Wrap toes around bottom of carriage. Spine and pelvis neutral. Holing hand straps or knots.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale rotate towards left side as the elbow bends to pull strap. Inhale return. Repete on left side&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Bet mindful of losing balance with heavier springs. To regress sit on a Long Box.&nbsp;</strong></em></p>', '1 RED 1 BLUE or 1 RED', null, '', '2018-03-28 04:18:43', '2018-04-03 20:48:34');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (9, 'Pelvic Curl ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels on foot bar. Spine neutral. Arms by sides. Head rest down.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale move through imprint, curl tail bone to pubic bone, pubic bone to navle roll up 1 vertebra at a time to T6.&nbsp;</p>
<p><br></p>
<p><strong>NOTE &nbsp;Be sure not to roll into spine extension. Sink the sternum lift the Pubic Bone.&nbsp;</strong></p>
<p><strong>Use the light spring setting for more hamstring connection, heavy spring for focus on spine articulation.&nbsp;</strong></p>', '3 RED or 1 BLUE', null, '', '2018-03-22 06:40:47', '2018-03-22 06:40:47');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (12, 'Pelvic Curl Press ', '<p><em><strong>Set up</strong></em></p>
<p>Supine. Heels on foot bar. Spine neutral. Arms by sides. Head rest down.&nbsp;</p>
<p><em><strong>The exercise</strong></em></p>
<p>Inhale to prepare. Exhale curl up into top of Pelvic Curl. Press carriage out and draw in.&nbsp;</p>
<p><em><strong>NOTE </strong></em>&nbsp;Be sure not to roll into spine extension. Sink the sternum lift the Pubic Bone.&nbsp;</p>
<p>Use the light spring setting for more hamstring connection, heavy spring for focus on spine articulation.&nbsp;</p>', '1-2 RED or 1 BLUE ', null, '', '2018-03-22 10:12:52', '2018-03-22 10:12:52');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (21, 'Footwork Rises ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Toes parallel on foot bar. Spine neutral. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Rise onto balls of feet then sink heels under the foot bar. Maintain Neutral Spine.&nbsp;</p>
<p><br></p>
<p><strong>NOTE </strong><em><strong>Smooth movement be sure not to bounce.</strong></em></p>', '3 RED ', null, '', '2018-03-22 11:03:35', '2018-03-22 11:03:35');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (23, 'Footwork Single Legs ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heel or toe on foot bar. Spine neutral. Arms by sides. Head rest comfortable.&nbsp;Single leg in table top&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press heel into foot bar to extend knees. Maintain Neutral Spine. Table top leg can reach under or over the bar.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Optional add pulses.&nbsp;</strong></em></p>', '3 RED or  2 RED ', null, '', '2018-03-22 11:14:32', '2018-03-22 11:14:32');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (13, 'Pelvic Curl Press Single Leg', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels on foot bar. Spine neutral. Arms by sides. Head rest down.&nbsp;one leg at table top.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale curl up into top of Pelvic Curl with single leg at table top. Press out and draw in.&nbsp;</p>
<p><br></p>
<p><strong>NOTE &nbsp;Be sure not to roll into spine extension. Sink the sternum lift the Pubic Bone.&nbsp;</strong></p>
<p><strong>Use the light spring setting for more hamstring connection, heavy spring for focus on spine articulation.</strong>&nbsp;</p>', '1-2 RED or 1 BLUE ', null, '', '2018-03-22 10:19:03', '2018-03-22 10:19:03');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (58, 'Kneeling Arm Series  Egyptian Arms ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling facing shoulder rests.Wrap toes around bottom of carriage. Spine and pelvis neutral. Foot or hand straps around elbows.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Straps on elbows arms at shoulder level shoulder distance apart elbows 90 degrees. Exhale press elbows back to goal post position. Inhale return to start position connect core on return.&nbsp;</p>
<p><br></p>', '1 RED +', null, '', '2018-03-28 04:38:33', '2018-03-28 04:38:33');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (65, 'Stomach Massage Monkey', '<p><u><strong>Set up</strong></u></p>
<p>Sitting on the bottom edge of carriage. Toes in V on foot bar. &nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>&nbsp;Holding onto foot bar between V toes. If this is not comfortable take toes wide on Foot bar. Exhale deepen core connection press toes into foot bar to extend the knees. Inhale return to start.&nbsp;</p>', '1 RED + ', null, '', '2018-03-28 05:27:32', '2018-03-28 05:27:32');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (20, 'Footwork VMO ', '<p><u><strong>Set up</strong></u></p>
<p>Supine.toes wide on foot bar knees together. Spine neutral. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press toes into foot bar keeoing knees together and pulse.&nbsp;</p>', '3 RED', null, '', '2018-03-22 11:01:00', '2018-04-01 15:01:49');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (18, 'Footwork Toes Wide ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Toes wide on foot bar. Spine neutral. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press toes into foot bar to extend knees. Maintain Neutral Spine.&nbsp;</p>
<p><br></p>
<p><strong>NOTE </strong><em><strong>Optional add pulses.&nbsp;</strong></em></p>', '3 RED +', null, '', '2018-03-22 10:36:17', '2018-04-01 15:02:09');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (17, 'Footwork Heels Wide ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels wide on foot bar. Spine neutral. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press heels into foot bar to extend knees. Maintain Neutral Spine.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Optional add pulses.&nbsp;</strong></em></p>', '3 RED +', null, '', '2018-03-22 10:35:07', '2018-04-01 15:02:22');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (14, 'Footwork Heels Parallel ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels on foot bar. Spine neutral. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press heels into foot bar to extend knees. Maintain Neutral Spine.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Optional add pulses.&nbsp;</strong></em></p>', '3 RED +', null, '', '2018-03-22 10:26:21', '2018-04-01 15:02:48');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (19, 'Jump Side Lying Bottom Leg Kick Up ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side lying on carriage head resting on underneath arm outstretched or propped up on elbow.&nbsp;Top Leg high center on jump board. Bottom leg low or sightly bent and off.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Inhale prepare, exhale jump in mid air adduct bottom leg to "kick up" to top leg. Land repeat.</p>', '1 BLUE', null, '', '2018-03-22 10:38:03', '2018-04-05 21:34:38');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (25, 'Elbows in Straps Up Down ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Elbows in straps (big loops) hands pressing up on knots. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Elbows pointing towards ceiling.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u>&nbsp;</p>
<p>Inhale prepare exhale pull elbows down towards ribs inhale elbows return to ceiling.</p>', '3 RED ', null, '', '2018-03-22 11:41:29', '2018-04-08 22:03:00');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (36, 'Abdominal series Chest Lift ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Reach arms to roof.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Begin by pressing into hands first lift the head, neck, shoulders and come into a a chest lift as you press arms by the sides.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Reach legs long as hands press down. Maintain neutral spine or imprint.&nbsp;</strong></em></p>', '1 RED, 1 BLUE ', null, '', '2018-03-24 01:00:50', '2018-03-24 01:00:50');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (35, 'Hands in Straps Cheerleader', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. SIngle arm to celiling single arm to side&nbsp;</p>
<p><br></p>
<p><u><em><strong>The exercise</strong></em></u></p>
<p>Bring both arms to side of body alternate arm that goes to the roof.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Come into chest lift if client is able to maintaion good neck stability, shoulder alignment and core control.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED decrease springs if there is neck tension. ', null, '', '2018-03-23 11:03:27', '2018-03-23 11:03:27');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (32, 'Hands in Straps Sides ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Hands reaching to the sides.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press the hands towards side of the body.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Come into chest lift if client is able to maintaion good neck stability, shoulder alignment and core control.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED decrease springs if there is neck tension. ', null, '', '2018-03-23 04:21:48', '2018-03-23 04:21:48');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (30, 'Feet in Straps Open Close ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Spine and Pelvis Neutral. Feet in Straps at bottom of metatarsal arch. Head rest comfortable. Legs 45 degrees.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale open both straight legs to the side exhale bring back together. Keep hips externally rotated. Can be samll or big.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Be sure to maintain neutral pelvis as legs move. If the pelvis is moving this is an idication that the core is not engaged correctly. Decrease the range or change the spring settings.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED or 1 BLUE ', null, '', '2018-03-23 01:07:29', '2018-03-23 01:07:29');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (29, 'Feet in Straps Peter Pan ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Spine and Pelvis Neutral. Feet in Straps at bottom of metatarsal arch. Head rest comfortable. Legs 45 degrees small V</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Take one leg to the side, bend the other knee to the stag possition. Keep equal tension on both straps.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Be sure to maintain neutral pelvis as legs move. If the pelvis is moving this is an idication that the core is not engaged correctly. Decrease the range or change the spring settings.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED, or 1 BLUE ', null, '', '2018-03-23 01:04:25', '2018-03-23 01:04:25');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (28, 'Feet In Straps Walking On The Ceiling. ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Spine and Pelvis Neutral. Feet in Straps at bottom of metatarsal arch. Head rest comfortable. Legs 45 degrees.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Send one straight leg to as close to 90 degrees at hip as possible bend the other knee. Maintain tension on both straps.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Be sure to maintain neutral pelvis as legs move. If the pelvis is moving this is an idication that the core is not engaged correctly. Decrease the range or change the spring settings.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED or 1 BLUE ', null, '', '2018-03-23 01:00:21', '2018-03-23 01:00:21');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (66, 'Stomach Massage Rotation ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting on the bottom edge of carriage. Toes in V on foot bar. &nbsp;</p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Lengthen spine into active neutral, or as close as possible. Reach arm diagonally up. Exhale deepen core connection press toes into foot bar to extend the knees. Rotate arm behind body at shoulder hight. Inhale return to both arms reaching diagonally up. Alternate arms.</p>', '1 RED +', null, '', '2018-03-28 05:28:35', '2018-03-28 05:28:35');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (51, 'Kneeling Arms Side Series Side Lift', '<p><u><em><strong>Set up</strong></em></u></p>
<p>Kneeling towards the side of carriage. Knees pelvis distance apart. Spine and pelvis neutral. Holing hand strap.</p>
<p><br></p>
<p><u><em><strong>The exercise</strong></em></u></p>
<p>Strap in hand closest to shoulder rest. Shoulder and elbow 90/90. Chest broad. Exhale lift hand up towards roof adducting shoulder. Imagine sliding back of hand up a wall.</p>
<p><br></p>
<p><em><strong>NOTE for beginners let them sit on a long box&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-03-26 07:58:52', '2018-03-26 07:58:52');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (50, 'Series 5 Single Straight Leg Stretch ', '<p><u><em><strong>Set up</strong></em></u></p>
<p>Supine. Table top legs. Hands interlaced behind head at occipital ridge. Elbows in peripheral vision.&nbsp;</p>
<p><br></p>
<p><u><em><strong>The excersice&nbsp;</strong></em></u></p>
<p>Legs extended into L shape. Holding behind one knee. Exhale switch pulling leg towards chest.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Do this on the mat or the long box</strong></em></p>', 'MAT', null, '', '2018-03-26 06:28:06', '2018-03-26 06:28:06');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (27, 'Feet in Straps Circles', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Spine and Pelvis Neutral. Feet in Straps at bottom of metatarsal arch. Head rest comfortable. Legs 45 degrees.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale lift straight legs to as close to 90 degrees as possible circle legs around to starting point. Alternate direction.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Be sure to maintain neutral pelvis as legs move. If the pelvis is moving this is an idication that the core is not engaged correctly. Decrease the range or change the spring settings.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED or 1 BLUE ', null, '', '2018-03-23 00:48:53', '2018-04-01 15:01:22');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (48, 'Series 5 Criss Cross', '<p><u><em><strong>Set up</strong></em></u></p>
<p>Supine. Table top legs. Hands interlaced behind head at occipital ridge. Elbows in peripheral vision.&nbsp;</p>
<p><br></p>
<p><u><em><strong>The exercise</strong></em></u></p>
<p>Interlace hands behind bead continue single bent leg stretch. Exhale oblique rotation towards bent leg. Be sure to rotate torso not just elbows.</p>
<p><br></p>
<p><em><strong>NOTE Do this on the Mat or Long Box</strong></em></p>', 'MAT', null, '', '2018-03-26 06:24:43', '2018-03-26 06:24:43');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (49, 'Series 5 Double Straight Leg Stretch ', '<p><u><em><strong>Set up</strong></em></u></p>
<p>Supine. Table top legs. Hands interlaced behind head at occipital ridge. Elbows in peripheral vision.&nbsp;</p>
<p><br></p>
<p><u><em><strong>The exercise</strong></em></u><u>&nbsp;</u></p>
<p>Hands interlaced behind head. Both legs extended creating L shape. Exhale lower legs to point of control. Inhale return.</p>
<p><br></p>
<p><em><strong>NOTE Do this on the long box or mat</strong></em></p>', 'MAT', null, '', '2018-03-26 06:27:01', '2018-03-26 06:27:01');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (45, 'Long Spine ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in straps. HEAD REST DOWN. Legs together parallel.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Come to L shape with legs. Exhale Roll through the spine to Scapular bringing feet directly above pelvis. Keep carriage still. Inhale feet to hip distance apart. Exhale keeping carriage still roll back down to L shape when pelvis reaches neutral circle legs back to start.</p>', '1 RED, 1 BLUE or 2 RED ', null, '', '2018-03-26 06:04:57', '2018-03-26 06:04:57');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (47, 'Series 5 Double Bent Leg Stretch ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Table top legs. Hands interlaced behind head at occipital ridge. Elbows in peripheral vision.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Pull both knees towards chest stretch arms and legs out on exhale circles arms around and pull knees back in.</p>
<p><br></p>
<p><em><strong>NOTE Do this on MAT or Long Box</strong></em></p>', 'MAT', null, '', '2018-03-26 06:10:51', '2018-03-26 06:10:51');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (46, 'Series 5 Single Bent Leg Stretch ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Table top legs. Hands interlaced behind head at occipital ridge. Elbows in peripheral vision.&nbsp;</p>
<p><br></p>
<p><u><strong>The Excercise&nbsp;</strong></u></p>
<p>Holding one leg at table top the other reached out straight. Hands on table top knee. Exhale switch. Keep toes in same plane.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Do this on Mat or Long Box</strong></em></p>', 'MAT', null, '', '2018-03-26 06:08:36', '2018-03-26 06:08:36');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (44, 'Long Spine Prep ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Feet in straps. HEAD REST DOWN. Heels together toes apart.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Come to L shape with legs. Exhale pelvic tilt bringing feet directly up above pelvis. Keep carriage still. Inhale feet to hip distance apart. Exhale keeping carriage still roll back down to L shape when pelvis reaches neutral circle legs back to start.</p>
<p><br></p>
<p><em><strong>NOTE Only do this if you know the people in your class and their limits.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED ', null, '', '2018-03-26 05:48:48', '2018-03-26 05:48:48');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (43, 'Short Spine', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Feet in straps. HEAD REST DOWN. Heels together toes apart.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale with straight legs take feet above pubic bone. L shape. Roll up through spine to to scapular, allow the carriage to move, feet over above head. Inhale bend knees. Exhale roll spine back down bringing heel with pubic bone. Inhale lengthen legs away.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Only do this if you know the people in your class and their limits.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED', null, '', '2018-03-26 05:46:05', '2018-03-26 05:46:05');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (42, 'Abdominal Series Double Straight Leg Stretch ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Reach arms to roof.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise&nbsp;</strong></u></p>
<p>Exhale chest lift. Inhale reach both legs towards ceiling as close to L shape as possible. Exhale lower both legs to point of control. Inhale return legs to L shape. Maintain Chest Lift.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE only go to ''point of control"</strong></em></p>', '1 RED, 1 BLUE ', null, '', '2018-03-26 05:36:44', '2018-03-26 05:36:44');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (41, 'Abdominal Series Double Bent Leg Stretch ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Reach arms to roof.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise&nbsp;</strong></u></p>
<p>Exhale chest lift reach both legs away from body until straight. Inhale return to table top. Maintain Chest Lift.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE only go to " point of control "</strong></em></p>', '1 RED, 1 BLUE ', null, '', '2018-03-26 05:33:49', '2018-03-26 05:33:49');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (52, 'Kneeling Arm Side Series RTC  ', '<p><u><em><strong>Set up</strong></em></u></p>
<p>Kneeling towards the side of carriage. Knees pelvis distance apart. Spine and pelvis neutral. Holing hand strap.</p>
<p><br></p>
<p><u><em><strong>The exercise</strong></em></u></p>
<p>Strap in hand closest to foot bar. Fist at navel. Elbow fist distance from waist. Exhale externally rotate humerus keeping the fist distance space between elbow and waist. Wrist long and neutral.</p>
<p><br></p>
<p><em><strong>NOTE Beginners sit on a Long Box</strong></em></p>', '1 YELLOW or 1 BLUE ', 'small-square.png', '', '2018-03-27 04:18:17', '2018-03-27 04:18:17');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (40, 'Abdominal Series Single Bent Leg Stretch ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Reach arms to roof.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise&nbsp;</strong></u></p>
<p>Exhale chest lift reach single leg away from body. Alternate legs. Keep toes in the same plane.</p>
<p><br></p>
<p><em><strong>NOTE Keep pelvis stable.&nbsp;</strong></em></p>', '1 RED, 1 BLUE ', null, '', '2018-03-26 05:33:00', '2018-03-26 05:33:00');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (38, 'Abdominal Series Co-ordination ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Reach arms to roof.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise&nbsp;</strong></u></p>
<p>Exhale chest lift arms go into tricep press as legs extended. Hold breath beat heels in, out. Inhale return legs to table top and arms to tricep press.</p>', '1 RED, 1 BLUE', null, '', '2018-03-26 05:15:22', '2018-03-26 05:15:22');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (37, 'Abdominal Series 100''s', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Reach arms to roof.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale chest lift. Beat arms down, inhale for 5 beats exhale for 5 beats. Reach straight legs to point of control. The goal is the full 100''s position.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE In the technique class do this in multipals of 20 or 50 untill you reach 100.&nbsp;</strong></em></p>', '1 RED, 1 BLUE ', null, '', '2018-03-26 05:12:30', '2018-03-26 05:12:30');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (116, 'Standing Side Splits Abduction Adduction ', '<p><u><strong>Set up</strong></u></p>
<p>Standing on foot plate FIRST. Other foot at centre bottom of carriage. Feet aligned.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Standing tall legs straight. Inhale Abduct legs Exhale Adduct Legs.</p>', '1 RED + or 1 BLUE ', null, '', '2018-04-01 21:13:20', '2018-04-01 21:13:20');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (26, 'Feet in Straps  Up Down ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Spine and Pelvis Neutral. Feet in Straps at bottom of metatarsal arch. Head rest comfortable. &nbsp;Feet Parallel legs straight. Start at 45 degrees.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale lift straight legs to as close to 90 degrees at hips while maintaining neutral spine. Exhale press straight legs down.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Be sure to maintain neutral pelvis as legs move. If the pelvis is moving this is an idication that the core is not engaged correctly. Decrease the range or change the spring settings.&nbsp;</strong></em></p>', '1 RED, 1 BLUE OR 2 RED, OR 1 BLUE ', null, '', '2018-03-22 11:43:49', '2018-03-22 11:43:49');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (59, 'Kneeling Arm Series Serving ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling facing foot bar. Toes against shoulder rests. Spine and pelvis neutral. Holing hand straps. Elbos bent as though holding a tray.&nbsp;</p>
<p><br></p>
<p><u><strong>The excersise&nbsp;</strong></u></p>
<p>Exhale press hands forward extending elbows keeping the tray level. Inhale return to start.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE &nbsp;Variation Exhale press hands forward extending elbows and continue into shoulder extension offering the tray. Inhale return to start.&nbsp;</strong></em></p>', '1 BLUE or 1 RED +', null, '', '2018-03-28 04:49:05', '2018-03-28 04:49:05');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (67, 'Mermaid', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Z sit on carriage facing sidewards. Hand on Foot bar forward of the centre of bar. Other arm outstretched.&nbsp;</p>
<p>&nbsp;</p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press hand into Foot bar as out stretched arm arcs up and over. Spine comes into lateral flexion. Inhale into top lung. Exhale return to starting position.&nbsp;</p>', '1 RED ', null, '', '2018-03-28 05:42:00', '2018-03-28 05:42:00');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (73, 'Kneeling Shoulder Press Straight Arm Spine Extension ', '<p><u><strong>Set up</strong></u></p>
<p>Active childs pose. Hands on Foot bar. Elbows down, fingertips to celiling.&nbsp;</p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale draw core away from thighs press hands into Foot bar to extend elbows. Inhale come into spine extension maintaing straight elbows. Exhale return to starting position.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Regression is to lye on a Long Box&nbsp;</strong></em></p>', '1 RED ', null, '', '2018-03-29 12:36:42', '2018-03-29 12:36:42');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (117, 'Standing Sides Splits Skiing ', '<p><u><strong>Set up</strong></u></p>
<p>Standing on foot plate FIRST. Other foot at centre bottom of carriage. Feet aligned.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Bend both knees. As the foot on the platform presses the knee extends as the carriage returns the knee comes back into flexion.</p>', '1 RED + or 1 BLUE ', null, '', '2018-04-01 21:18:30', '2018-04-01 21:18:30');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (76, 'Rowing Back Series Flat Back', '<p><u><strong>Set up</strong></u></p>
<p>Sitting tall on carriage legs long through shoulder rests.</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Arms at 90/90. Hinge at hips maintaining flat back to a point of control. Exhale extend elbows and reach hands above head. Inhale returners to 90/90. Repeat&nbsp;</p>', '1 RED ', 'Triceps.jpg', '', '2018-03-29 12:49:55', '2018-03-30 13:51:36');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (77, 'Rowing Back Series Serving ', '<p><u><strong>Set up</strong></u></p>
<p>Seated tall facing foot bar. Knees extended.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Elbows at 90 by waist. Inhale to prepare. Exhale press hands forward extending elbows spine comes into spine stretch forward. Inhale tun palms to face down and lift up to flat back exhale return through sine stretch to start.&nbsp;</p>', '1 RED ', null, '', '2018-03-30 22:21:39', '2018-03-30 22:21:39');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (78, 'Rowing Back Series Feed the Birds ', '<p><u><strong>Set up</strong></u></p>
<p>Seated tall facing foot bar. Knees extended.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Hands pressing into carriage. Exhale slide hands forward palms down through spine stretch all the way up to L position. Inhale circle arms around back to start position.</p>', '1 RED ', null, '', '2018-03-30 22:25:53', '2018-03-30 22:25:53');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (79, 'Green Room Arms Rolling Back ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting at bottom edge of carriage. Knees bent. Feet on Head Rest. Holding straps in bicep curl. Elbows level with shoulders. Sitting tall. &nbsp;</p>
<p><br></p>
<p><u><strong>The Excercise&nbsp;</strong></u></p>
<p>Inhale to prepare. Exhale roll back into C curve until Sacrum is in contact with carriage. Inhale extend elbows. Exhale gentle bicep curl x10. Exhale roll back up to start position.&nbsp;</p>', '1 BLUE ', null, '', '2018-03-30 22:30:22', '2018-03-30 22:30:22');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (80, 'Green Room Arms Obliques ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting at bottom edge of carriage. Knees bent. Feet on Head Rest. Holding straps in bicep curl. Elbows level with shoulders. Sitting tall. &nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale roll back into C curve until Sacrum is in contact with carriage. Take knees to left rotate thoracic to right. Inhale extend elbows. Exhale gentle bicep curl x10. Alternate sides.</p>', '1 BLUE ', null, '', '2018-03-30 22:31:27', '2018-03-30 22:34:43');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (81, 'Short Box Series Round Back ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting on short box. Feet under foot strap. Arms folded on chest, behind head or reaching up.</p>
<p>&nbsp;</p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale sitting on top of sit bones neutral spine and pelvis. Exhale imprint sacrum and lumber spine and roll back into a C curve. Inhale to posterior lateral ribs rolling back up maintain C curve. Find top of sit bones and stack spine and pelvis back to neutral.</p>
<p><br></p>
<p><em><strong>NOTE &nbsp;Cross hands over chest. Progression Hands behind head, reaching up or holding weights.&nbsp;</strong></em></p>', '3 RED 1 BLUE 1 YELLOW', null, '', '2018-03-30 22:51:34', '2018-04-01 15:00:16');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (83, 'Short Box Series Flat Back ', '<p>&nbsp;<u><strong>Set up</strong></u></p>
<p>Sitting on short box. Feet under foot strap. Arms folded on chest, behind head or reaching up.</p>
<p><u>&nbsp;</u></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale sitting on top of sit bones neutral spine and pelvis. Exhale hinge from hips back. Inhale return.&nbsp;</p>
<p><br>
<em><strong>NOTE &nbsp;Cross hands over chest. Progression Hands behind head, reaching up or holding weights.&nbsp;</strong></em></p>', '3 RED 1 BLUE 1 YELLOW', null, '', '2018-03-31 17:28:51', '2018-04-01 14:59:59');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (82, 'Short Box Series Obliques ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting on short box. Feet under foot strap. Arms folded on chest, behind head or reaching up.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale sitting on top of sit bones Rotate ribs and shoulders to the side. Exhale imprint sacrum and lumber spine and roll back connecting ribs to opposite side of pelvis. Inhale to posterior lateral ribs rolling back up maintain rotation and rib pelvis connection. Find top of sit bones and unwind spine back to neutral.</p>
<p><br></p>
<p><em><strong>NOTE &nbsp;Cross hands over chest. Progression Hands behind head, reaching up or holding weights.&nbsp;</strong></em></p>', '3 RED 1 BLUE 1 YELLOW', null, '', '2018-03-30 22:54:10', '2018-04-01 15:00:08');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (118, 'Standing Side Splits with Rotation  ', '<p><u><strong>Set up</strong></u></p>
<p>Standing on foot plate FIRST. Other foot at centre bottom of carriage. Feet aligned.&nbsp;</p>
<p><br></p>
<p><u><strong>The Excersise&nbsp;</strong></u></p>
<p>Abduction and adduction adding rotation of torso and shoulders knees are soft movement if fluid let arms flow.&nbsp;</p>', '1 RED + or 1 BLUE ', null, '', '2018-04-01 21:21:24', '2018-04-01 21:21:24');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (93, 'Reverse Abdominals Obliques ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling on carriage knees fist distance from shoulder rests. Both hands on one side of frame.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press shins into carriage to pull carriage towards wrists. Inhale return to start position.</p>
<p><br></p>
<p><em><strong>NOTE Pull from abdominals and lats not upper traps. Keep shoulders drawing away from ears.&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-03-31 21:40:32', '2018-04-08 23:12:51');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (89, 'Hamstring Curl Double Leg', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box arms crossed elbow pushing into box. Slight thoracic and cervical extension. Feet in straps. tension in straps.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale pull hells tosits bones. Keep knees lifted off the box to &nbsp;lengthen hamstring.&nbsp;</p>', '2 RED', null, '', '2018-03-31 17:54:20', '2018-03-31 18:00:05');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (90, 'Hamstring Curl Single Leg', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box arms crossed elbow pushing into box. Slight thoracic and cervical extension. Feet in straps. tension in straps.&nbsp;</p>
<p>&nbsp;</p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale pull single hell to sit bone. Keep knee lifted off the box to lengthen hamstring to return to start.</p>
<p><br></p>', '2 RED ', null, '', '2018-03-31 18:04:41', '2018-03-31 18:04:41');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (92, 'Reverse Abdominals Flat Back ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling on carriage knees fist distance from shoulder rests. Hands on frames wrists under shoulders.Flat Back.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press shins into carriage to pull carriage towards wrists. Inhale return to start position.</p>
<p><br>
<em><strong>NOTE Pull from abdominals and lats not upper traps. Keep shoulders drawing away from ears.&nbsp;</strong></em></p>', '1 RED or 1 BLUE ', null, '', '2018-03-31 21:37:39', '2018-03-31 21:40:42');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (91, 'Reverse Abdominals Round Back ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling on carriage knees fist distance from shoulder rests. Hands on frames wrists under shoulders. Round Back.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press shins into carriage to pull carriage towards wrists. Inhale return to start position.</p>
<p><br>
<em><strong>NOTE Pull from abdominals and lats not upper traps. Keep shoulders drawing away from ears.&nbsp;</strong></em></p>', '1 RED or 1 BLUE', null, '', '2018-03-31 21:36:22', '2018-03-31 21:40:53');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (94, 'Reverse Abdominals Single Leg', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling single leg on carriage knee fist distance from shoulder rests. other leg reaching back. Hands on frames wrists under shoulders. Round Back.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press shin into carriage to pull carriage towards wrists. Inhale return to start position.</p>
<p><br></p>
<p><em><strong>NOTE Pull from abdominals and lats not upper traps. Keep shoulders drawing away from ears.&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-03-31 21:43:29', '2018-03-31 21:43:29');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (88, 'Short Box Series Side Release ', '<p><u><strong>Set up</strong></u></p>
<p>Side sitting on short box one leg extended and foot under strap the other tucked up on box. Lean away from Foot bar until there is tension in foot strap and one sit bone has lifted off box.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Release into short box mermaid. Breathing into top lateral ribs.</p>', '3 RED 1 BLUE 1 YELLOW', null, '', '2018-03-31 17:51:05', '2018-04-01 14:56:32');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (87, 'Short Box Series Airplane', '<p><u><strong>Set up</strong></u></p>
<p>Side sitting on short box one leg extended and foot under strap the other tucked up on box. Lean away from Foot bar until there is tension in foot strap and one sit bone has lifted off box.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Lean out hands behind head. Exhale rotate chest towards ground and reach arms out sideways. Return to side reach hands behind head. Repeat.&nbsp;</p>', '3 RED 1 BLUE 1 YELLOW', null, '', '2018-03-31 17:48:59', '2018-04-01 14:57:00');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (86, 'Short Box Series Side Reaches ', '<p><u><strong>Set up</strong></u></p>
<p>Side sitting on short box one leg extended and foot under strap the other tucked up on box. Lean away from Foot bar until there is tension in foot strap and one sit bone has lifted off box.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale rotate chest towards foot bar deepen core connection and pulse up reaching the arms.</p>', '3 RED 1 BLUE 1 YELLOW', null, '', '2018-03-31 17:45:49', '2018-04-01 14:57:09');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (85, 'Short Box Series Sides', '<p><u><strong>Set up</strong></u></p>
<p>Side sitting on short box one leg extended and foot under strap the other tucked up on box. Lean away from Foot bar until there is tension in foot strap and one sit bone has lifted off box.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale lengthen spine and side bend. Exhale connect ribs to pelvis to return to start.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE &nbsp;Variations &nbsp;Arm position. Across chest, behind head or reaching long.&nbsp;</strong></em></p>', '3 RED 1 BLUE 1 YELLOW', null, '', '2018-03-31 17:40:11', '2018-04-01 14:59:43');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (95, 'Semi Circle ', '<p><u><strong>Set up</strong></u></p>
<p>Hands on shoulder rests. Elbows extended. Scapular on edge of carriage. Balls of feet on foot bar feet in a V . Pelvis pressed up.</p>
<p><br></p>
<p><u>&nbsp;</u><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press toes into foot bar to extend knees keeping pelvis lifted. Roll down into spine extension. Inhale draw carriage in as knees bend drag bottom along springs. Exhale pelvic curl to starting position.&nbsp;</p>', '2 RED or 1 RED, 1 BLUE ', null, '', '2018-03-31 21:46:38', '2018-03-31 21:46:38');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (96, 'Long Box Pulling Straps Preparation ', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box legs stretched out long heels together or wide. Spine neutral. Holding the frame.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Holding the frame inhale to prepare. Exhale bend the elbows to bull the box towards wrists. Maintain neutral spine.&nbsp;</p>', '1 RED + or 1 BLUE ', null, '', '2018-03-31 21:51:03', '2018-03-31 21:51:03');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (97, 'Long Box Pulling Straps Up Down ', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box legs stretched out long heels together or wide. Spine neutral. Holding onto the ropes at knots.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Holding straps. Shoulders extended arms on the outside of carriage. Exhale pull the straps to mid thigh.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Maintain neutral or move through neutral and &nbsp;into spine extension as hands come to mid thigh.&nbsp;</strong></em></p>
<p><br></p>', '1 RED + ', null, '', '2018-03-31 21:55:50', '2018-03-31 21:55:50');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (98, 'Long Box Pulling Straps Sides ', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box legs stretched out long heels together or wide. Spine neutral. Holding onto the ropes at knots.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Holding ropes at the knot. Open arms out to T shape wrists in line with shoulders. Elbows straight. Exhale pull the straps to mid thigh.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Maintain neutral or move through neutral and &nbsp;into spine extension as hands come to mid thigh.&nbsp;</strong></em></p>', '1 RED + ', null, '', '2018-03-31 21:57:41', '2018-03-31 22:01:17');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (99, 'Long Box Pulling Straps Triceps ', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box legs stretched out long heels together or wide. Spine neutral. Holding onto the ropes at knots.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>&nbsp;</p>
<p>Keep arms by sides Inhale bend the elbows. Exhale extend the elbows.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Maintain neutral or move through neutral and &nbsp;into spine extension as hands come to mid thigh.&nbsp;</strong></em></p>', '1 RED + ', null, '', '2018-03-31 22:02:39', '2018-03-31 22:02:39');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (102, 'Swan ', '<p><u><strong>Set up</strong></u></p>
<p>Feet in V on Foot plate. Prone on long box knees bent. Arms by side.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale extend knees into dart position 3 times. On the third time extend arms above head into full spine extension. Three bends on knees. Return to start.</p>', '1 RED ', null, '', '2018-03-31 22:21:59', '2018-03-31 22:21:59');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (103, 'Teaser Mat ', '<p><u><strong>Set up</strong></u></p>
<p>Supine on mat. Arms extended above head. Legs extended long.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale Brings arms over shoulders. Exhale begin to roll up collect legs to teaser position. Inhale at top. Exhale roll back down lowering legs.&nbsp;</p>', 'Mat', null, '', '2018-03-31 22:24:18', '2018-03-31 22:24:18');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (104, 'Teaser', '<p><u><strong>Set up</strong></u></p>
<p>Supine on long box. Hands in straps.100s Position. Or table top.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale scoop arms roll through chest lift into balance point simultaneously as hips come into flexion creating a V shape. Inhale at top. Exhale reverse to roll down back to start.&nbsp;</p>', '1 RED ', null, '', '2018-03-31 22:27:46', '2018-03-31 22:27:46');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (107, 'Elephant ', '<p><u><strong>Set up</strong></u></p>
<p>Heels fits distance from shoulder rest toes lifted. Hands on foot bar. Round back.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Inhale press heels into carriage pull toes towards navel and press carriage back. Shoulders remain the same. Exhale pull carriage back to stopper</p>
<p><br></p>
<p><em><strong>NOTE If hamstrings alow it bring feet closer to the middle of the carriage.&nbsp;</strong></em></p>', '1 RED, 1 BLUE ', null, '', '2018-04-01 00:10:39', '2018-04-01 00:12:50');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (101, 'Swimming on Long Box with Straps ', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box legs stretched out long heels together or wide. Holding straps. Head towards foot bar. Foot bar down.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Both arms reaching past head. Elbows straight. Wrists shoulder distance apart. Lift opposite arm and leg. Switch.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE for advanced clients come into spine extension.</strong></em></p>', '1 RED + ', null, '', '2018-03-31 22:07:23', '2018-04-08 23:05:58');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (100, 'Breaststroke on Long Box with Straps ', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box legs stretched out long heels together or wide. Holding straps. Head towards foot bar. Foot bar down.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Holding loops. Reach arms above head. Inhale circle arms around. Exhale bend elbows to press back to start. Like breast stroke. Change directions.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; For advanced clients come into spine extension.</strong></em></p>', '1 RED + ', null, '', '2018-03-31 22:06:28', '2018-04-08 22:59:12');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (105, 'Kneeling Abdominals', '<p><u><strong>Set up</strong></u></p>
<p>Four Point kneeling facing foot bar.&nbsp;Knees at front of carriage toes relaxed. Hands of footplate. armpits over wrists hips over knees. Tesion in the spring. &nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press knees backwards shoulders maintain 90 degree angle. Inhale return back to start position.&nbsp;</p>
<p>Exhale press hands into footplate taking shoulders into extension hips maintain 90 degree angle. Inhale return back to start position.&nbsp;</p>
<p>Combine the two.&nbsp;</p>', '1 YELLOW or 1 BLUE', null, '', '2018-03-31 22:31:14', '2018-04-08 23:11:33');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (106, 'Kneeling Abdominals Single Arm and Leg', '<p><u><strong>Set up</strong></u></p>
<p>Four Point kneeling facing foot bar. Knees at front of carriage toes relaxed. Hands of footplate. Armpits over wrists hips over knees. Tesion in the spring.&nbsp;Single leg extended back opposite arm extended forward&nbsp;</p>
<p>&nbsp;</p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press knee backwards shoulder maintains 90 degree angle. Inhale return back to start position.&nbsp;</p>
<p>Exhale press hand into footplate taking shoulder into extension hips maintain 90 degree angle. Inhale return back to start position.&nbsp;</p>
<p>Combine the two.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Maintain set up position.&nbsp;</strong></em></p>', '1 YELLOW or 1 BLUE ', null, '', '2018-03-31 22:35:06', '2018-04-08 23:14:03');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (33, 'Hands in Straps Circles ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Hands reaching to ceiling.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press the arms around. Alternate directions.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Come into chest lift if client is able to maintaion good neck stability, shoulder alignment and core control.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED decrease springs if there is neck tension. ', 'Triceps.jpg', '', '2018-03-23 10:01:28', '2018-04-01 09:14:24');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (31, 'Hands in Straps Up Down ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Hands in straps. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Hands reaching to ceiling.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press the hands down to sides Inhale return. Maintain set up position while disassociating the shoulders.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Come into chest lift if client is able to maintaion good neck stability, shoulder alignment and core control.&nbsp;</strong></em></p>', '1 RED, 1 BLUE or 2 RED decrease springs if there is neck tension. ', 'Triceps.jpg', '', '2018-03-23 01:14:57', '2018-04-01 09:14:31');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (84, 'Short Box Series Climb A Tree ', '<p>&nbsp;</p>
<p><em><strong>Set up</strong></em></p>
<p>Seated on short box one out under foot strap other pulled into chest. Hands holding back of thigh. Spine as neutral as possible.&nbsp;</p>
<p>&nbsp;</p>
<p><em><strong>The exercise</strong></em></p>
<p>Exhale extend knee 3 times. Inhale walk hands up back of leg to ankle. Exhale walk hands down back of leg to top of thigh. &nbsp;Walk hands down to top of thigh roll back into spine extension. Letting go of thigh. Circle arms around and roll back up to starting point.&nbsp;</p>', '3 RED 1 BLUE 1 YELLOW', null, '', '2018-03-31 17:34:25', '2018-04-01 14:59:51');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (24, 'Feet in Straps Small Frogs ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Spine and Pelvis Neutral. Feet in Straps at bottom of metatarsal arch. Head rest comfortable. &nbsp;Feet in V knees in like with second big toe.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press feet into straps to move. Spine and Pelvis maintain neutral. Push equal pressure in both feet.&nbsp;</p>', '1 RED, 1 BLUE or 2 RED or 1 BLUE ', null, '', '2018-03-22 11:31:56', '2018-04-01 15:01:35');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (16, 'Footwork Small V ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Toes in small V on foot bar. Spine neutral. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press toes into foot bar to extend knees. Maintain Neutral Spine. Squeeze heels together.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Optional add pulses.&nbsp;</strong></em></p>', '3 RED + ', null, '', '2018-03-22 10:33:53', '2018-04-01 15:02:31');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (110, 'Inverted V Single Leg ', '<p><u><strong>Set up</strong></u></p>
<p>Heels on shoulder rests toes on carriage in high heel position. Hands shoulder distance apart on foot bar. Lift one leg to reach back&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Press into extended plank position. Exhale lift hips to inverted V on single leg. Inhale return to extended plank. Shoulders maintain position. Alternate legs.&nbsp;</p>', '1 RED 1 BLUE ', null, '', '2018-04-01 20:30:35', '2018-04-08 23:23:28');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (112, 'Jack Rabbit ', '<p><u><strong>Set up</strong></u></p>
<p>Heels on shoulder rests toes on carriage in high heel position. Hands shoulder distance apart on foot bar.</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Press into extended plank. Inhale pull knees in towards foot bar. Maintain shoulder alignment. Exhale return to start.&nbsp;</p>', '1 RED 1 BLUE ', null, '', '2018-04-01 20:43:17', '2018-04-01 20:43:17');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (111, 'Jack Rabbit Single Leg', '<p><u><strong>Set up</strong></u></p>
<p>Heels on shoulder rests toes on carriage in high heel position. Hands shoulder distance apart on foot bar. &nbsp;Reach straight single leg back&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Press into extended plank. Exhale pull knee in towards foot bar. Maintain shoulder alignment. Inhale return to extended plank and flex free leg into chest.&nbsp;</p>', '1 RED 1 BLUE ', null, '', '2018-04-01 20:32:54', '2018-04-01 20:48:40');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (113, 'Arabesque ', '<p><u><strong>Set up</strong></u></p>
<p>One heel on shoulder rests toes on carriage in high heel position. Other foot hovering above head rest. Hands shoulder distance apart on foot bar.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Press into extended plank position. Hover 1 foot over head rest. Exhale lift hips to inverted V as the carriage comes in lift hovering leg into arabesque. Inhale return to extended plank lowering arabesque leg. Shoulders maintain position.</p>', '1 RED 1 BLUE ', null, '', '2018-04-01 20:58:08', '2018-04-01 20:58:08');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (114, 'Scooter', '<p><u><strong>Set up</strong></u></p>
<p>Standing next to carriage one foot on ground other heel against shoulder rest. Knees bent. Pelvis aligned. Hands on Foot bar.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press heel into shoulder rest taking the hip into extension. Inhale return.&nbsp;</p>
<p><br></p>', '1 RED', null, '', '2018-04-01 21:00:26', '2018-04-01 21:00:26');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (115, 'Hip Flexor Stretch ', '<p><u><strong>Set up</strong></u></p>
<p>Standing next to carriage one foot on ground other heel against shoulder rest. Knees bent. Pelvis aligned. Hands on Foot bar.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u>&nbsp;</p>
<p>From Scooter position press back into his flexor stretch. Maintain lowest rib over ASIS.&nbsp;</p>', '1 RED ', null, '', '2018-04-01 21:09:12', '2018-04-01 21:09:12');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (109, 'Long Stretch ', '<p>&nbsp;<u><strong>Set up</strong></u></p>
<p>Heels on shoulder rests toes on carriage in high heel position. Hands shoulder distance apart on foot bar.&nbsp;</p>
<p><br></p>
<p><u><strong>Exercise&nbsp;</strong></u></p>
<p>Press into extended plank. Exhale bring shoulders over wrists. Inhale return to extended plank. Hips maintain position.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Keeping plank strong thoughout.</strong></em></p>', '1 RED 1 BLUE', null, '', '2018-04-01 20:25:40', '2018-04-08 23:27:12');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (108, 'Inverted V ', '<p><u><strong>Set up</strong></u></p>
<p>Heels on shoulder rests toes on carriage in high heel position. Hands shoulder distance apart on foot bar.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Press into extended plank position. Exhale lift hips to inverted V. Inhale return to extended plank. Shoulders maintain position.</p>', '1 RED 1 BLUE ', null, '', '2018-04-01 15:44:31', '2018-04-08 23:22:18');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (119, 'Standing Side Splits Pli', '<p><u><strong>Set up</strong></u></p>
<p>Standing on foot plate FIRST. Other foot at bottom of carriage. Feet aligned.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale pli press carriage out. Inhale extend knees and pli keeping carriage still. Exhale bring carriage back to start maintain pli&nbsp;</p>', '1 RED + or 1 BLUE ', null, '', '2018-04-01 21:39:19', '2018-04-01 21:39:19');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (120, 'Standing Side Splits Dancer Squats', '<p><u><strong>Set up</strong></u></p>
<p>Standing on foot plate FIRST. Other foot at bottom of carriage. Feet aligned externally rotated at hips. 1st possition.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale pli press carriage out. Hold carriage out and still. squat x 10. &nbsp;Exhale bring carriage back to start maintain pli&nbsp;</p>', '1 RED + or 1 BLUE ', null, '', '2018-04-01 21:44:54', '2018-04-01 21:46:06');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (121, 'Front Splits Preparation ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>One foot on foot bar the other in high heel on the shoulder rest</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Holding onto the foot bar either side of foot. Exhale extend knee. Inhale return to start.&nbsp;</p>', '1 RED and 1 BLUE ', null, '', '2018-04-01 21:49:28', '2018-04-01 21:49:28');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (122, 'Front Splits', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>One foot on foot bar the other in high heel on the shoulder rest</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Lifting hands up either crossed at chest or reaching out to sides.Bring body upright. Inhale extend front knee. Exhale return.&nbsp;</p>', '1 RED 1 Blue', null, '', '2018-04-01 21:52:19', '2018-04-01 21:52:19');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (123, 'Russian Splits', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>One foot on foot bar the other in high heel on the shoulder rest</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Lifting hands up either crossed at chest or reaching out to sides.Bring body upright.Extend both knees. Inhale press back into splits. Exhale return to start.&nbsp;</p>', '1 RED 1 BLUE ', null, '', '2018-04-01 21:53:45', '2018-04-01 21:53:45');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (124, 'Russian Splits Back Knee', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>One foot on foot bar the other in high heel on the shoulder rest</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Lifting hands up either crossed at chest or reaching out to sides.Bring body upright.Extend both knees. Inhale press back into semi split bend back leg and extend x 8-10. Exhale return to start.&nbsp;</p>', '1 RED 1 BLUE ', null, '', '2018-04-01 21:55:35', '2018-04-01 21:55:35');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (167, 'Mountain Climber ', '<p><u><strong>Set Up</strong></u></p>
<p>Plank position.</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare, exhale draw single leg in towards chest. Alternate legs.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Maintain plank postion try not to lift but in the air as leg pulls in.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-04 22:53:45', '2018-04-04 22:53:45');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (125, 'Jump Preparation ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Feet on jump board. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Feet parallel. Inhale bend knees. Exhale extend knees.&nbsp;</p>', '2 RED + or 1 BLUE ', 'Triceps-Portrait.jpg', '', '2018-04-01 22:12:08', '2018-04-01 23:25:41');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (126, 'Jump Footwork Small V ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in small V on jump board. Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Feet in small V. Inhale bend knees. Exhale jump.</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '2 RED + or 1 BLUE ', 'Triceps.jpg', '', '2018-04-01 22:17:16', '2018-04-02 00:35:45');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (127, 'Jump Footwork Wide V ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in wide V on jump board. Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Feet in widel V. Inhale bend knees. Exhale jump.</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '2 RED + or 1 BLUE ', null, '', '2018-04-02 10:21:34', '2018-04-02 10:21:54');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (128, 'Jump Footwork Wide Parallel ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in wide parallel on jump board. Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Feet in wide parallel. Inhale bend knees. Exhale jump.</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '2 RED + or 1 BLUE ', null, '', '2018-04-02 10:23:18', '2018-04-02 10:23:18');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (129, 'Jump Chest Lift ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in any of the foot work positions on jump board. Hands interlaced behind head.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale jump come into a chest lift. Inhale bend knees exhale jump.&nbsp;</p>
<p><br></p>
<p><br></p>', '1 BLUE ', null, '', '2018-04-02 10:25:46', '2018-04-02 10:25:46');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (131, 'Jump Single Straight Leg ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Feet parallel on jump board. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Legs parallel. One leg at extended to ceiling to create L shape. Inhale bend knee. Exhale extend knee to jump. Switch legs or continue with single leg, or batterie &nbsp;<em>(beat legs).</em></p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '1 RED + or 1 BLUE ', null, '', '2018-04-02 10:43:34', '2018-04-02 10:43:34');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (132, 'Jump Side Lying Single Top Leg ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side lying on carriage head resting on underneath arm outstretched or propped up on elbow.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Top leg on jump board bottom leg bent. &nbsp;Neutral pelvis. Inhale bend knee. Exhale extend knee to jump</p>
<p><br></p>', '1 BLUE ', null, '', '2018-04-02 11:04:22', '2018-04-02 11:04:22');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (133, 'Jump Side Lying Bottom Leg', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side lying on carriage head resting on underneath arm outstretched or propped up on elbow.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Bottom leg on jump board top leg bent. &nbsp;Neutral pelvis. Inhale bend knee. Exhale extend knee to jump</p>', '1 BLUE ', null, '', '2018-04-02 11:05:09', '2018-04-02 11:05:09');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (134, 'Jump Side Lying Switches ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side lying on carriage head resting on underneath arm outstretched or propped up on elbow.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Top leg on jump board bottom leg bent. &nbsp;Neutral pelvis. Inhale bend knee. Exhale jump and switch legs.&nbsp;</p>', '1 BLUE ', null, '', '2018-04-02 11:07:21', '2018-04-02 11:07:21');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (139, 'Jump Obliques', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine on carriage. Feet parallel on jump board. Arms straight reaching towards celiling. Holing weights optional. &nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Chest lift with reaching arms diagonally towards ceiling rotate chest and arms to an oblique chest lift. Jump and rainbow arms and chest to otherside. Repeate. Maintain a stable neutral pelvis while jumping.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE put a ball or prop under upper thoracic to support neck. Can leave head down.&nbsp;</strong></em></p>
<p><br></p>', '1 BLUE ', null, '', '2018-04-02 14:14:38', '2018-04-03 16:31:43');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (136, 'Jump Kneeling Legs', '<p><u><strong>Set up</strong></u></p>
<p>Quadruped with hands on shoulder rests. Neutral spine. Single leg extended onto jump board. Leg Parallel.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale bend knee. Exhale extend knee to jump.&nbsp;</p>', '1 BLUE or 1 RED ', null, '', '2018-04-02 11:15:21', '2018-04-05 22:51:55');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (140, 'Star Jumps ', '<p><u><strong>Set Up</strong></u></p>
<p>Standing on Mat&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Used as a cardio warm up for jump. Can be done as a full jump or a step out.&nbsp;</p>', 'MAT ', null, '', '2018-04-02 17:54:44', '2018-04-02 17:54:44');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (8, 'Double Leg Lowers ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels on lowered foot bar, mat or a long box on the mat. Spine neutral<em> </em><em><strong>or imprint</strong></em>. Arms by sides. Head rest comfortable.&nbsp;Both legs at table top.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale connect to the core, anchor low ribs &nbsp;lower legs from table top to point of control. Maintain <strong>Neutral Spnie</strong> or <strong>Imprint</strong>. &nbsp;</p>
<p><br></p>
<p><em><strong>NOTE: People with with low back pain, or decreaced core control may find it helpful to maintain a gentle imprint. Be sure it is an imprint not a pelvic tilt.&nbsp;</strong></em></p>', '3 RED or 1 BLUE or MAT', null, '', '2018-03-22 06:26:06', '2018-04-02 17:58:09');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (141, 'Dead Bugs ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Supine on carriage, mat or a long box on the mat. Legs at table top straight arms reaching to ceiling. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare, exhale reach oppisite arm and leg away from eachother. Maintain neutral spine or imprint. Keeping fingertips and toes in the same plane.&nbsp;</p>
<p><br></p>', '2 RED or MAT ', 'medium-square.png', '', '2018-04-02 18:00:12', '2018-04-03 11:45:16');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (142, 'Tricep Dips', '<p><u><strong>Set Up</strong></u></p>
<p>Hands on the edge of carriage or Box on the mat elbows straight. Legs bent.</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u><u>&nbsp;</u></p>
<p>Inhave bend elbows into tricep dip keep shoulders drawing away from ears.&nbsp;</p>', 'MAT', null, '', '2018-04-03 14:28:06', '2018-04-03 14:28:06');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (143, 'Chest Lift ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Lying supine on carriage or mat knees bent on foot bar, mat or top of jump board. Hands interlaced behind head.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Inhale prepare. Exhale lift head neck and shoulders into chest lift.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Stay in chest lift and add single leg lifts, double leg lowers.&nbsp;</strong></em></p>', '2 RED or MAT ', null, '', '2018-04-03 14:35:44', '2018-04-03 14:35:44');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (144, 'Jump Obliques', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>', '', null, '', '2018-04-03 14:50:39', '2018-04-03 14:50:39');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (135, 'Jump Side Lying Front Kick ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side lying on carriage head resting on underneath arm outstretched or propped up on elbow.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Top leg on jump board bottom leg bent. &nbsp;Neutral pelvis. Inhale bend knee. Exhale jump top leg kicks front and returns for landing.&nbsp;</p>', '1 BLUE ', null, '', '2018-04-02 11:08:44', '2018-04-03 16:44:41');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (138, 'Jump Kneeling Arms ', '<p><u><strong>Set up</strong></u></p>
<p>Quadruped with hands on jump board. Hips 130 or 90</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale bend elbows. Exhale extend elbows to jump. Be mindful that the core is engaged.&nbsp;</p>', '1 BLUE ', null, '', '2018-04-02 14:13:40', '2018-04-05 22:51:28');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (137, 'Jump Kneeling Legs External Rotation ', '<p><u><strong>Set up</strong></u></p>
<p>Quadruped with hands on shoulder rests. Neutral spine. Single leg extended onto jump board in external rotation. Rotate entire pelvis. Look towards foot.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhal prepare exhale jump.&nbsp;</p>
<p>&nbsp;</p>
<p><br></p>', '1 BLUE or 1 RED ', null, '', '2018-04-02 14:05:13', '2018-04-05 22:51:42');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (146, 'Jump Footwork Parallel ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet parallel on jump board. Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Feet &nbsp;parallel. Inhale bend knees. Exhale jump.</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '2 RED + or 1 BLUE ', null, '', '2018-04-03 16:35:28', '2018-04-03 16:35:28');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (145, 'Jump Heel Beats', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in wide parallel on jump board. Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Feet in wide parallel. Inhale bend knees. Exhale jump beat heels together toes pointed, land wide V&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '2 RED + or 1 BLUE ', null, '', '2018-04-03 16:33:07', '2018-04-03 16:36:32');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (147, 'Jump Footwork Combo ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in parallel on jump board. Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>&nbsp;Inhale bend knees. Exhale jump.move through all the foot work positions. Parallel, small V, wide V, hell beat.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '2 RED + ', null, '', '2018-04-03 16:38:17', '2018-04-03 16:38:17');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (148, 'Jump Marching ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in parallel on jump board. Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Run or march on the spot. This is an interval training exercise. Do 10 - 20 slow &nbsp;10- 20 &nbsp;fast.</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '2 RED + ', null, '', '2018-04-03 16:40:47', '2018-04-03 16:40:47');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (149, 'Jump Side Lying Kick Up ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side lying on carriage head resting on underneath arm outstretched or propped up on elbow.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Top leg on jump board bottom leg bent. &nbsp;Neutral pelvis. Inhale bend knee. Exhale jump top leg kicks up towards roof and returns for landing.&nbsp;</p>', '1 BLUE ', null, '', '2018-04-03 16:44:26', '2018-04-03 16:44:26');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (150, 'Side Lying Jump Bent Knee ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side lying on carriage head resting on underneath arm outstretched or propped up on elbow.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Top leg on jump board bottom leg bent. &nbsp;Neutral pelvis. Inhale bend knee. Exhale jump top knee bents front and returns for landing.&nbsp;</p>', '1 BLUE ', null, '', '2018-04-03 16:47:42', '2018-04-03 16:47:42');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (151, 'Jump Side to Side ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet parallel to side of jump board. Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale bend knees. Exhale jump.to other side of jup board. Keep feet parallel.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '2 RED + or 1 BLUE ', null, '', '2018-04-03 16:48:31', '2018-04-03 16:49:52');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (152, 'Jump Around the World', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet parallel on jump board at top center. Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale bend knees. Exhale jump."around the worls" start jump at top land to side to bottom to otherside to top. Continue in same direction or alternate directions.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '2 RED + ', null, '', '2018-04-03 16:51:37', '2018-04-03 16:51:37');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (153, 'Kneeling Arm Series Bicep Curl ', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling facing shoulder rests.Wrap toes around bottom of carriage. Spine and pelvis neutral. Holing hand straps&nbsp;or knots. elbows straight hands in line with shoulders. &nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale draw hands closer to shoulders flexing elbows into a bicep curl. Inhale return arms to start.&nbsp;Lower elbows if there is neck tension otherwise be mindful to keep elbows in line with shoulders.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE Bet mindful of losing balance with heavier springs. To regress sit on a Long Box.&nbsp;</strong></em></p>', '1 BLUE 1 RED or 1 RED ', null, '', '2018-04-03 20:57:39', '2018-04-03 20:57:39');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (154, 'Short Box 4 Point Kneeling Parallel', '<p><u><strong>Set Up</strong></u></p>
<p>Short Box on carriage. Elbows on box single knee bent on carriage, single leg on jump board. Leg parallel knee pointing towards the springs.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale press the foot into jump board to extend the knee inhave flex the knee. Keep elbow plank 90/90.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Be mindful that the torso and elbos remain in place the action comes from the glutes and the knee</strong></em>.&nbsp;</p>', '1 RED or 1 RED 1 BLUE ', null, '', '2018-04-03 21:18:42', '2018-04-03 21:18:42');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (155, 'Short Box 4 Point Kneeing External Rotation', '<p><u><strong>Set Up</strong></u></p>
<p>Short Box on carriage. Elbows on box single knee bent on carriage, single leg on jump board. Leg externally rotated from hip.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale press the foot into jump board to extend the knee inhave flex the knee. Keep elbow plank 90/90.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Be mindful that the torso and elbos remain in place the action comes from the glutes and the knee</strong></em>.&nbsp;</p>', '1 RED 1 BLUE or 1 BLUE ', null, '', '2018-04-03 21:20:08', '2018-04-03 21:20:46');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (156, 'Short Box Side Plank Parallel', '<p><u><strong>Set Up</strong></u></p>
<p>Short Box on carriage. Side elbows plank single leg on jump board. Leg parallel. Hips square.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale press the foot into jump board to extend the knee inhave flex the knee. Keep elbow plank 90/90.</p>
<p>&nbsp;</p>
<p><em><strong>NOTE; Be mindful that the torso and elbos remain in place the action comes from the glutes and the knee</strong></em>.&nbsp;</p>', '1 RED 1 BLUE or ! BLUE', null, '', '2018-04-03 21:28:54', '2018-04-03 21:28:54');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (157, 'Short Box Side Plank External Rotation ', '<p><u><strong>Set Up</strong></u></p>
<p>Short Box on carriage. Side elbows plank single leg on jump board. Leg externally rotated.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale press the foot into jump board to extend the knee inhave flex the knee. Keep elbow plank 90/90.</p>
<p><br></p>
<p><em><strong>NOTE; Be mindful that the torso and elbos remain in place the action comes from the glutes and the knee</strong></em>.&nbsp;</p>', '1 RED 1 BLUE or 1 BLUE', null, '', '2018-04-03 21:29:52', '2018-04-03 21:29:52');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (159, 'Jump Elbows Ski ', '<p><u><strong>Set Up</strong></u></p>
<p>Supine on carriage. Elbows propped against shoulder rests. Hands on small of back or by hips. Feet together in center of jump board, toes pointing towars top right coner of jump board</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale Jump and land with toes pointing to top left side of jump board. Maintain "poolside" elbow position. gentle imprint of lumber spine.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Regres by putting rolled up mat against shoulder rests and coming into a chest lift.&nbsp;</strong></em></p>', '2 RED or 1 RED', null, '', '2018-04-03 21:40:03', '2018-04-07 22:18:44');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (160, 'Jump Ski ', '<p><u><strong>Set Up</strong></u></p>
<p>Supine on carriage.Head rest comfortable or in chest lift. Feet together in center of jump board, toes pointing towars top right coner of jump board</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale Jump and land with toes pointing to top left side of jump board.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Come into cest lift and lighten the springs to make it more about abdominals.&nbsp;</strong></em></p>', '2 RED or 1 RED or 1 BLUE', null, '', '2018-04-03 21:41:14', '2018-04-03 21:44:28');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (158, 'Jump Elbows Footwork ', '<p><u><strong>Set Up</strong></u></p>
<p>Supine on carriage. Elbows propped against shoulder rests. Hands on small of back or by hips.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale Jump. Maintain "poolside" elbow position. gentle imprint of lumber spine. Work though selected footwork.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Regres by putting rolled up mat against shoulder rests and coming into a chest lift.&nbsp;</strong></em></p>', '2 RED or 1 RED ', null, '', '2018-04-03 21:36:06', '2018-04-07 22:18:52');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (161, 'Roll Back on Long Box ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Long Box on mat. Sitting on edge of Long Box arms out stretched. Feet flat on the floor.</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Inhale prepare exhale roll back one vertebra at a time onto long box. Inhale at bottom exhale roll up. Keep feet on floor.&nbsp;</p>', 'MAT', null, '', '2018-04-03 21:53:21', '2018-04-03 21:53:21');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (162, 'Step Ups', '<p><u><strong>Set Up</strong></u></p>
<p>Press Long Box against the frame of reformer on mat.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Step up onto box 15 seconds slow 20 seconds fast.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Make sure box is pressed up against the reformer to ensure the box doesn''t slip.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-03 21:59:17', '2018-04-03 21:59:17');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (163, 'Booty Ball Squeeze', '<p><u><strong>Set Up</strong></u></p>
<p>Standing holding on to edge of jump board or wall. Hold ball between calf and hamstring. Gently squeezing.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Press heel towards sitbone squeezing ball.&nbsp;</p>', 'MAT', null, '', '2018-04-04 22:25:59', '2018-04-04 22:25:59');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (164, 'Booty Ball Squeeze Back ', '<p><u><strong>Set Up</strong></u></p>
<p>Standing holding on to edge of jump board or wall. Hold ball between calf and hamstring. Gently squeezing.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Press heel towards sitbone squeezing ball and extend hip. Return to set up repeate&nbsp;</p>', 'MAT ', null, '', '2018-04-04 22:27:48', '2018-04-04 22:27:48');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (165, ' Booty Ball Fire Hydrant ', '<p><u><strong>Set Up</strong></u></p>
<p>Standing holding on to edge of jump board or wall. Hold ball between calf and hamstring. Gently squeezing.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Press heel towards sitbone squeezing ball and Abduct the hip. Return to set up repeat.&nbsp;</p>', 'MAT ', null, '', '2018-04-04 22:43:05', '2018-04-04 22:43:05');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (166, 'Plank to Row ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Holding weights in plank position.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Pull single arm into shoulder extension flexing elbow. "elbowing the person behine you". Alternate arms.&nbsp;</p>
<p><br></p>
<p><em><strong>Note; Maintain strong plank and neutral pelvis thoughout.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-04 22:47:15', '2018-04-04 22:47:15');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (168, 'Roll Back with Strap ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Seated on mat diagonally next to Reformer knees bent feet flat on the ground. Holding onto strap closest to you &nbsp;at knot.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare feel sitbones on the floor. Exhale intitate roll back with a lumbur imprint roll back one vertebra at a time until sacrum is in contact with the mat. Stop just before T6/T7&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Use the strap to help deepen articulation of the spine as rolling down.&nbsp;</strong></em></p>', '1 BLUE', null, '', '2018-04-04 23:10:17', '2018-04-04 23:10:17');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (169, 'Half Curl with Strap ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Seated on mat diagonally next to Reformer knees bent feet flat on the ground. Holding onto strap closest to you &nbsp;at knot.Inhale prepare feel sitbones on the floor. Exhale intitate roll back with a lumbur imprint roll back one vertebra at a time until sacrum is in contact with the mat. &nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare exhale deepen core connection and curl up half way. Keep the sacrum anchored and deepen the thoracic curl. Inhale roll back. Repeat.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Use the strap to help deepen articulation of the spine as rolling down.&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-04-04 23:14:26', '2018-04-04 23:14:26');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (178, 'Bent Leg Press Jump T.B', '<p><u><strong>Set up</strong></u></p>
<p>Supine. THERA BAND over heel leg in table top. Other leg parelle on jump board.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale jump. In mid air press THERA BAND leg straight. Inhale land on jump leg return THERA BAND leg to table top. After 10 alternate sides.&nbsp;</p>', '1 YELLOW 1 BLUE ', null, '', '2018-04-05 16:14:49', '2018-04-05 16:15:30');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (170, 'Single Bent Leg Stretch with Strap ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Seated on mat diagonally next to Reformer knees bent feet flat on the ground. Holding onto strap closest to you &nbsp;at knot.Inhale prepare feel sitbones on the floor. Exhale intitate roll back with a lumbur imprint roll back one vertebra at a time until sacrum is in contact with the mat. &nbsp;</p>
<p><br></p>
<p><u><strong>The Excercise&nbsp;</strong></u></p>
<p>Holding one leg at table top the other reached out straight. Exhale switch. Keep toes in same plane.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Keep pelvis stable.&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-04-04 23:18:19', '2018-04-04 23:21:55');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (171, 'Oblique Rotation with Strap ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Seated on mat diagonally next to Reformer knees bent feet flat on the ground. Holding onto strap closest to you &nbsp;at knot.Inhale prepare feel sitbones on the floor. Exhale intitate roll back with a lumbur imprint roll back one vertebra at a time until sacrum is in contact with the mat. &nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale bend elbows and rotate thoracic spine into oblique twist. Alternate sides. &nbsp;Keep fists infront of heart at all times.&nbsp;</p>', '1 BLUE ', null, '', '2018-04-04 23:25:29', '2018-04-04 23:25:29');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (172, 'Roll Up with Strap ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Lying diagonally supine on mat next to Reformer holding onto strap. Legs straight.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare, exhale nod chin to throat roll up one vertebra at a time. Inhale at top, Exhale roll back.&nbsp;</p>
<p><br></p>
<p><u><strong>NOTE; Use the stap to deepen core connection and spine articulation.</strong></u></p>', '1 BLUE ', null, '', '2018-04-04 23:31:38', '2018-04-04 23:31:38');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (173, 'Ball Footwork ', '<p><u><strong>Set Up</strong></u></p>
<p>Supine on carriage, head rest comfortable, arms by sides. Feet on blue ball in center or jump board.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale press feet into ball, extend knees squeezing legs together. Inhale return.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Core must be active to keep ball still.&nbsp;</strong></em></p>', '2 RED 1 BLUE ', null, '', '2018-04-04 23:42:36', '2018-04-04 23:42:36');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (174, 'Ball Footwork Single Leg', '<p><u><strong>Set Up</strong></u></p>
<p>Supine on carriage, head rest comfortable, arms by sides Single foot on blue ball in center or jump board, other leg at table top.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale press foot into ball, extend knee maintian other leg at table top.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Core must be active to keep ball still.&nbsp;</strong></em></p>', '2 RED 1 BLUE ', null, '', '2018-04-04 23:44:12', '2018-04-04 23:44:12');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (175, 'Jump Ball Between Ankles Parallel ', '<p><u><strong>Set Up</strong></u></p>
<p>Supine on carriage, head rest comfortable, arms by sides or in a chest lift. Ball between ankles. Feet in center of jump board paralle.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u>&nbsp;</p>
<p>Feet &nbsp;parallel. Inhale bend knees. Exhale jump. squeezing ball between ankles.&nbsp;</p>
<p><br></p>
<p><u><strong>NOTE; You can move through different positions from here. Jump Skiing, Jump side to side, Jump Around The World.</strong></u></p>', '2 RED 1 BLUE or 1 BLUE ', null, '', '2018-04-04 23:47:18', '2018-04-04 23:56:33');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (176, 'Jump Footwork Internal Rotation ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet wide internally rotated at hip on jump board. Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale bend knees. Exhale jump.</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '2 RED 1 BLUE ', null, '', '2018-04-05 16:00:38', '2018-04-05 16:00:38');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (177, 'Hamstring Stretch Jump T.B', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Feet parallel on jump board. Head rest comfortable.&nbsp;Single straight leg reaching up THERA BAND over heel in a hamstring stretch. Holding THERA BAND with hands.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Maintain Hamstring stretch. Exhale extend knee to jump.&nbsp;After 10 alternate legs.&nbsp;</p>', '1 BLUE 1 YELLOW ', null, '', '2018-04-05 16:08:45', '2018-04-05 16:16:49');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (179, 'Pelvic Curl with T.B', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels on jump board. Spine neutral.Thread THERA BAND underneath head and around shoulder restes. Arms by sides holding onto THERA BAND. Head rest down.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale move through imprint, curl tail bone to pubic bone, pubic bone to navle roll up 1 vertebra at a time to T6.&nbsp;Hold at top and pulse arms up and dowm maintating tension on thera band.&nbsp;</p>
<p><br></p>
<p><strong>NOTE &nbsp;Be sure not to roll into spine extension. Sink the sternum lift the Pubic Bone.&nbsp;</strong></p>', '1 YELLOW 1 BLUE ', null, '', '2018-04-05 16:23:30', '2018-04-05 16:25:04');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (180, 'Scapular Dips ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Press Back into scooter position. Hand closest to Reformer on high footbar. Other hand holing weight. Lean body forward.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Let the weight of the hand weight drag the arm forward protracting the shoulder. Scapular gluides around. Exhale activate core retract scapular. Repeate.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Use what ever weight it appropriate.&nbsp;</strong></em></p>', '1 RED or 2 RED', null, '', '2018-04-05 20:42:20', '2018-04-05 20:42:20');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (181, 'Squat to Shoulder Press ', '<p><u><strong>Set Up</strong></u></p>
<p>Weights optional. Standing with feet wide. Holding weights at shoulders.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale squat, flexing the knees and hips to lower your body. Pause for a brief moment at the bottom exhale returning to a standing position by extending the hips and knees press the weights overhead activate glutes. Return the weights to the shoulder before repeating the entire movement. Do as many as possible in 30 secons for 3 sets or specify number of squats.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; If advanced add jump into shoulder press.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-05 20:47:33', '2018-04-05 20:49:13');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (182, 'Lunge to Knee Drive ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Standing on mat prepare to lunge. Hand weights optional.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Inhale lunge sigle leg back. Exhale drive knee forward. Oppisite elbow comes to knee. Repeat on same leg or alternate.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE: Do this as a HIIT set or delegate number of repetitions&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-05 20:53:18', '2018-04-05 20:53:18');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (183, 'Squat to Oblique Knee', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Wide stance. Hand weights optional.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Inhale wide squat as knees extend shift weight to one side. Lift other leg knee bent rotate torso and punch oppisite fist to knee.&nbsp;Repeat on same leg or alternate.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE: Do this as a HIIT set or delegate number of repetitions&nbsp;</strong></em></p>', 'MAT', null, '', '2018-04-05 20:55:38', '2018-04-05 20:56:13');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (184, 'Kneeling Arm Press ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Knneing on carriage. Hands on top of jump board. Hips at 90/90.</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Inhale flex elbows into arm press. Exhale extend elbows.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Keep chest low and hips at 90/90</strong></em></p>', '1 YELLOW 1 BLUE ', null, '', '2018-04-05 20:58:53', '2018-04-05 20:58:53');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (185, 'Kneeling Hip Extension ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Knneing on carriage. Hands on top of jump board. Hips at 90/90.</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale extend hips back. Inhale retern to 90/90.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Keep chest low. Only go to point of control.&nbsp;</strong></em></p>', '1 YELLOW 1 BLUE ', null, '', '2018-04-05 21:00:51', '2018-04-05 21:00:51');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (187, 'Jump Mermaid Arms Flat Back ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Z sit on carriage facing sidewards. Hand on jump board other out stretched in line with shoulder. Flat back.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press hand into jump board and jump. Maintain set up position though out.&nbsp;</p>', '1 YELLOW or 1 BLUE ', null, '', '2018-04-05 21:05:54', '2018-04-05 21:05:54');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (186, 'Jump Mermaid Arms', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Z sit on carriage facing sidewards. Hand on jump board other hand over head. Bring torso into lateral flexion.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press hand into jump board and jump. Maintain set up position though out.&nbsp;</p>
<p><br></p>
<p><br></p>', '1 YELLOW  or 1 BLUE ', null, '', '2018-04-05 21:04:30', '2018-04-05 21:06:14');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (188, 'Side Lying Glutes with Jump Board ', '<p><u><strong>Set Up</strong></u></p>
<p>Side Lying on carriage. Head resting on underneth arm or propped up on elbow. Both legs straight and pressing into center of jump board as though standing.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Lift top leg up and down for 10. Circles in each direction for 10. Forward back for 10. Maintain string sidelying position. keeping body stablle and pelvis stacked.</p>
<p><br></p>
<p><em><strong>NOTE; This is not a jumping exercise but is coupled nicely with Side Lying Jumping.&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-04-05 21:13:43', '2018-04-05 21:13:43');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (189, 'Jump Side Lying Bottom Leg Kick Up ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side lying on carriage head resting on underneath arm outstretched or propped up on elbow.&nbsp;Top leg at top center of jumpboard. Bottom leg at bottom center.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale jump. Adduct bottom leg to top leg to "kick up" &nbsp;Return to set up. Reteat.&nbsp;</p>', '1 BLUE', null, '', '2018-04-05 21:30:19', '2018-04-05 21:43:11');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (190, 'Burpee', '<p><u><strong>Set up&nbsp;</strong></u></p>
<p>Stand with your feet shoulder-width apart, weight in your heels, and your arms at your sides.</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Push hips back, flex knees, and lower your body into a squat. Place hands on the floor directly in front of, and just inside, feet. Shift weight onto them. Jump feet back to softly land on the balls of your feet in a plank position. Your body should form a straight line from your head to heels. Jump feet back so that they land just outside of hands. Reach your arms over head and explosively jump up into the air. Land and immediately lower back into a squat for next rep.</p>
<p><br></p>
<p><em><strong>Note; Variation can be done on side Reformer frame not the ground for plank.&nbsp;</strong></em></p>', 'Mat', null, '', '2018-04-05 21:49:43', '2018-04-05 21:49:43');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (192, 'Thera Band I.T.B Stretch ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine on carriage. Head rest comfortable. Single leg pressed into footbar or jump board. Thera Band around heel of other leg.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>The leg come into an L shape. Draw the stretching leg across body to stretch ITB. Keep knees as straight as possible.&nbsp;Let the pelvis roll towards leg.&nbsp;</p>
<p><br></p>', '1 RED ', null, '', '2018-04-05 22:03:01', '2018-04-05 22:03:01');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (191, 'Thera Band Hamstring Stretch ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine on carriage. Head rest comfortable. Single leg pressed into footbar or jump board. Thera Band around heel of other leg.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>The legs come into an L shape. Draw the stretching leg towards chest. Keep knees as straight as possible.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE: Be mindful not to let the pelvis tuck under.&nbsp;</strong></em></p>', '1 RED ', null, '', '2018-04-05 21:54:17', '2018-04-05 22:03:14');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (193, 'Thera Band Adductor Stretch ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine on carriage. Head rest comfortable. Single leg pressed into footbar or jump board. Thera Band around heel of other leg.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>The leg come into an L shape. Draw the stretching leg away from body to stretch adductors. Keep knees as straight as possible.Keep the pelvis as stable as possible. &nbsp;</p>', '1 RED ', null, '', '2018-04-05 22:05:00', '2018-04-05 22:05:00');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (194, 'Standing Quad Stretch ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Standing on single leg, holding other ankle or foot against bottom.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Pull ankle towards sit bone stretching the quads.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Hold onto jump board or wall if needed.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-05 22:07:49', '2018-04-05 22:07:49');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (196, 'Running on the Spot ', '<p><u><strong>Set Up</strong></u></p>
<p>Standing on mat weights optional.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Running on the spot for 20 seconds then change directions untill all 4 corners of room have been faced.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Think flashdance!&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-05 22:57:42', '2018-04-05 22:57:42');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (197, 'Rainbow Squats ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>On mat.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Single leg squat back wide then "rainbow squat" untill back leg crosses squatting leg.</p>', 'MAT ', null, '', '2018-04-05 23:00:57', '2018-04-05 23:00:57');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (198, 'Comandos ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Plank on Mat&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>From plank bring elbows down one at a time to an elbow plank then reverse back to straight arm plank.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Be mindful to maintain strong plank position thoughout exercise.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-05 23:05:07', '2018-04-05 23:05:07');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (204, 'Jumping Light Magic Circle ', '<p>Set Up&nbsp;</p>
<p>Supine&nbsp;</p>', '1 BLUE ', null, '', '2018-04-06 23:42:00', '2018-04-06 23:42:00');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (199, 'Green Room Magic Circle Squeeze ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting at bottom edge of carriage. Knees bent. Feet on Head Rest. Holding straps arms straight. Magic Circle between knees.</p>
<p><br></p>
<p><u><strong>The Excercise&nbsp;</strong></u></p>
<p>Inhale to prepare. Exhale roll back into C curve until Sacrum is in contact with carriage. Hold position and squeeze magic circle 10 times. Exhale deepen core connection and roll up.&nbsp;</p>', '1 BLUE', null, '', '2018-04-05 23:06:32', '2018-04-05 23:09:49');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (200, 'Green Room Magic Circle Bicep Curls ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting at bottom edge of carriage. Knees bent. Feet on Head Rest. Holding straps in bicep curl. Elbows level with shoulders. Magic Circle between knees&nbsp;</p>
<p><br></p>
<p><u><strong>The Excercise&nbsp;</strong></u></p>
<p>Inhale to prepare. Exhale roll back into C curve until Sacrum is in contact with carriage. Inhale extend elbows. Exhale gentle bicep curl x10 and squeen magic circle at same time.&nbsp;</p>', '1 BLUE ', null, '', '2018-04-05 23:10:52', '2018-04-05 23:12:48');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (201, 'Green Room Magic Circle Row ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting at bottom edge of carriage. Knees bent. Feet on Head Rest. Straps crossed holding straps at knots. Elbows wide level with shoulders. Magic Circle between knees&nbsp;</p>
<p><br></p>
<p><u><strong>The Excercise&nbsp;</strong></u></p>
<p>Inhale to prepare. Exhale roll back into C curve until Sacrum is in contact with carriage. Rowing arms 10 times. Return to set up.&nbsp;</p>', '1 BLUE ', null, '', '2018-04-05 23:13:50', '2018-04-05 23:15:30');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (202, 'Green Room Arms High Breast Stroke ', '<p><u><strong>Set up</strong></u></p>
<p>Sitting at bottom edge of carriage. Knees bent. Feet on Head Rest. Holding straps.Magic Circle between knees&nbsp;</p>
<p><br></p>
<p><u><strong>The Excercise&nbsp;</strong></u></p>
<p>Inhale to prepare. Exhale roll back into C curve until Sacrum is in contact with carriage. Reach arms above head in breast stroke motion. Reteat or alternate directions.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Maintain C curve and deep core connection throughout.</strong></em></p>', '1 BLUE ', null, '', '2018-04-05 23:18:44', '2018-04-05 23:18:44');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (206, 'Jump Single Leg Combo ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Feet parallel on jump board. Arms by sides. Head rest comfortable.&nbsp; Or hands interlaced behind head in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Single leg table top parallel exhale jump switch legs mid air externally rotate single leg switch mid air.</p>
<p><br></p>
<p><em><strong>NOTE; In external rotation bring the toe to the jumping legs knee.&nbsp;</strong></em></p>', '1 BLUE 1 RED or 2 RED + ', null, '', '2018-04-06 23:54:39', '2018-04-06 23:58:30');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (203, 'Jumping Light Magic Circle ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet parallel on jump board with Magic Circle between ankles. Hands interlaced behind head in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Feet &nbsp;parallel Magic Circle between ankles. &nbsp;Inhale bend knees. Exhale jump.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Keep legs and feet parallel thoughout jumping.&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-04-06 23:40:43', '2018-04-06 23:50:12');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (205, 'Jump Magic Circle Driving ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet parallel on jump board with Magic Circle between ankles. Hands interlaced behind head in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Feet &nbsp;parallel Magic Circle between ankles. &nbsp;Inhale bend knees. Exhale jump rotate legs to the right and left before landing. Alternate directions.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Stay stable in chest lift.&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-04-06 23:53:29', '2018-04-06 23:53:29');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (207, 'Side Lying Magic Circle Adductor Squeeze', '<p><u><strong>Set Up</strong></u></p>
<p>Side lying. Head rests on outstretched arm. Standing on center of jump board Magic Cirle between knees.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale squeeze Magic Circle. Be midful to squeeze top leg to bottom leg.</p>
<p><br></p>
<p><br></p>', '1 RED ', null, '', '2018-04-07 00:03:43', '2018-04-07 00:03:43');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (195, 'Jump Kneeling Legs Stag ', '<p><u><strong>Set up</strong></u></p>
<p>Quadruped with hands on shoulder rests. Neutral spine. Single leg extended onto jump board in external rotation. Rotate entire pelvis. Look towards foot.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhal prepare exhale jump in mid air flex hip and pull knee towards armpit to stag position.&nbsp;</p>', '1 BLUE or 1 RED ', null, '', '2018-04-05 22:26:59', '2018-04-07 11:44:27');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (208, 'Plank Side Arm Press ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Plank position. Feet on floor one hand on carriage other hand on foot plate. Lean shoulder against jump board if needed.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale abduct (press out) carriage arm. Inhale return.&nbsp;10 each side of Reformer.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Maintain strong plank position.&nbsp;</strong></em></p>', '1 BLUE + ', null, '', '2018-04-07 00:08:08', '2018-04-07 00:08:35');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (209, 'Single Leg Squats ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Standing to the side of Reformer back to Reformer. Single foot on carriage. Both legs parallel.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Inhale prepare. Exhale single leg squat. Knee stays over or behind ankle never in front while squatting. 10 each side.</p>
<p><br></p>
<p><em><strong>NOTE; Make sure carriage is sprung.</strong></em></p>', 'MAT ', null, '', '2018-04-07 00:14:31', '2018-04-07 11:38:06');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (210, 'Wide Squat Reach ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Legs wide. Hand weights optional.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Wide squat reaching left arm to right ankle. Right arm reaches directly to ceiling. Alternate sides. To make it advanced add a jump squat inbetween each side reach.&nbsp;</p>', 'MAT', null, '', '2018-04-07 11:43:11', '2018-04-07 11:43:11');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (211, 'Chest Lift Feet on Jump Board', '<p><u><strong>Set up</strong></u>&nbsp;</p>
<p>Feet on center of jump board together. Legs straight. Hands interlaced behing head or holding Magic Circle optional.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare, exhale lift head neck shoulders into a chest lift.&nbsp;</p>', '2 RED', null, '', '2018-04-07 11:49:35', '2018-04-07 11:49:35');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (212, 'Oblique Squeeze Magic Circle', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Single Leg on parallel on jump board, other leg at table top. Magic Circle pressing into table top knee oppisite hand holding Magic Circle in place other hand behing head.</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Come into a chest lift. Squeeze Magic Circle into table to knee and knee into Magic Circle activating adductors. 10 Squeezes each side.&nbsp;</p>', '2 RED', null, '', '2018-04-07 11:51:43', '2018-04-07 12:06:38');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (213, 'Jump Footwork Criss Cross Ankles. ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in small V. &nbsp;Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale bend knees. Exhale jump Criss Cross ankles while mid air.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '1 BLUE or 1 RED ', null, '', '2018-04-07 12:10:18', '2018-04-07 12:10:18');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (214, '100''s Straight Legs on Jump Board', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Legs straight feet paralle on center Jump Board.&nbsp;</p>
<p>If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Reach arms to roof.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhale chest lift. Beat arms down, inhale for 5 beats exhale for 5 beats. Feel as though legs are "standing" on jump board.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Holding Magic Circle is optional.&nbsp;</strong></em></p>', '2 RED', null, '', '2018-04-07 12:14:01', '2018-04-07 12:14:01');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (22, 'Jump Elbows Single Leg Single Arm ', '<p><u><strong>Set Up</strong></u></p>
<p>Supine on carriage. Elbows propped against shoulder rests in "poolside position". Hands on small of back or by hips.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale Jump. Reach arm out diagonally elbow straight opposite leg at Table Top. Bring elbow back to land. Alternate legs or keep going with same leg.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Regres by putting rolled up mat against shoulder rests and coming into a chest lift.&nbsp;</strong></em></p>', '1 Blue', null, '', '2018-03-22 11:05:34', '2018-04-07 22:19:13');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (215, 'Step Up''s Knee Drive ', '<p><u><strong>Set Up</strong></u></p>
<p>Press Long Box against the frame of reformer on mat.&nbsp;Hand weights optional.</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Step up onto box, drive knee forward, step off box. &nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Make sure box is pressed up against the reformer to ensure the box doesn''t slip.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-07 12:14:44', '2018-04-07 18:44:47');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (216, 'Side Lunge Over Head Press ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Standing wide on mat. Weights optional.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u>&nbsp;</p>
<p>Shift weight to one side for side lunge push off bent (lunging side) come to single leg standing lunge leg ankle at knee press weights above head. Repeat.&nbsp;</p>', 'MAT', null, '', '2018-04-07 19:02:18', '2018-04-07 19:02:18');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (217, 'Shoulder Press on Toes. ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Standing on mat feet together holding hand weights.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Squeesing legs together rising up onto balls of feet bend knees into demi squat. Bring arms to goal post position. Elbows 90/90. Press arms above head x 10, 3 sets.&nbsp;</p>', 'MAT ', null, '', '2018-04-07 19:07:20', '2018-04-07 19:07:20');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (218, 'Sumo Squat', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Standing on mat.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u>&nbsp;</p>
<p>Jump into wide squat bring hands to floor between feet jump back into plank. Jump to wide squat with hands between feet. Jump legs together standing upright.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; modify by taking out the jump and replace with stepping.&nbsp;</strong></em></p>', 'MAT', null, '', '2018-04-07 21:34:41', '2018-04-07 21:34:41');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (219, 'Jump Elbows Single Legs ', '<p><u><strong>Set Up</strong></u></p>
<p>Supine on carriage. Elbows propped against shoulder rests in "poolside position". Hands on small of back or by hips. Gentle imprint of lumber spine.&nbsp;Single leg at Table Top&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale Jump. Maintain "poolside" elbow position. Switch legs mid air.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Regres by putting rolled up mat against shoulder rests and coming into a chest lift.&nbsp;</strong></em></p>', '1 Blue', null, '', '2018-04-07 21:41:13', '2018-04-07 22:17:59');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (220, 'Jump Elbows Teaser ', '<p><u><strong>Set Up</strong></u></p>
<p>Supine on carriage. Elbows propped against shoulder rests in "poolside position". Hands on small of back or by hips.&nbsp;Both feet on jump board.</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale Jump. Reach both arms out diagonally elbows straight to Teaser position. Bring elbow back to land.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Regres by putting rolled up mat against shoulder rests and coming into a chest lift.&nbsp;</strong></em></p>', '1 Blue', null, '', '2018-04-07 22:04:51', '2018-04-07 22:21:07');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (221, 'Plank to Pigeon ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Plank on mat.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale bring single leg forward into pigeon position. Inhale return to plank. Alternate legs.&nbsp;</p>', 'MAT', null, '', '2018-04-07 22:28:28', '2018-04-07 22:28:28');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (222, '1/2 Roll Back ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Sitting on the mat knees bent feet flat on the floor holding single hand weight.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Inhale to prepare. Exhale initiate roll back by imprinting the lumbar spine scooping low abs in and rolling back halfway. Inhale at bottom, exhale roll up.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Only go to point of control.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-07 23:07:54', '2018-04-07 23:07:54');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (223, 'Roll Back Oblique Twist Single Leg ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Sitting on the mat knees bent feet flat on the floor holding single hand weight.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Inhale to prepare. Exhale initiate roll back by imprinting the lumbar spine scooping low abs in and rolling back halfway. Rotate shoulders to the side taking weight to same side lift single leg to table top (same sibe weight is on). Alternate sides x 10 Roll back up.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Only go to point of control.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-07 23:09:23', '2018-04-07 23:11:04');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (224, 'Single Leg Ups ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Lying on Mat. Single leg reaching up to ceiling. Legs in L shape. Holing single weight reaching up to ceiling.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale reach hands up to wards ankle of leg pointing to celing. Pulse x 10. Change sides.&nbsp;</p>', 'MAT ', null, '', '2018-04-07 23:15:15', '2018-04-07 23:15:15');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (225, 'Plank to V ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Elbow plank on mat.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise&nbsp;</strong></u></p>
<p>Exhale lift hips to inverted V Inhale return to elbow plank. &nbsp;x 10&nbsp;</p>', 'MAT ', null, '', '2018-04-07 23:17:20', '2018-04-07 23:17:20');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (226, 'Leg Pull Front ', '<p><u><strong>Set Up</strong></u></p>
<p>Plank on mat.</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u>&nbsp;</p>
<p>Inahle to prepare. Exhale lift single straight leg up. Keep it low and pelvise alighned. Alternate legs.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Maintain good head neck and shoulder alignment. Come to elbows if there are wrist issues.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-07 23:21:36', '2018-04-07 23:21:36');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (227, 'Side Plank Knee Bends ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side elbow plank on reformer. Be sure shoulder is over elbow. Feet on foot plate crossed at ankles top leg in front. Hand on hip.</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Squeezing adductors together bend knees. Maintain strong plank and shoulder alignment. Extend knees.&nbsp;</p>', '1 BLUE or 1 RED ', null, '', '2018-04-07 23:25:51', '2018-04-07 23:25:51');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (228, 'Side Plank Twist ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side elbow plank on reformer. Be sure shoulder is over elbow. Feet on foot plate crossed at ankles top leg in front. Hand reaching towards ceiling.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Squeezing adductors together keeping legs straight. Inhale prepare. Exhale lift hips up. &nbsp;Top arm reaches under hips "threading the needle" Inhale return to set up.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Initiate the movement with abdominal activation.</strong></em>&nbsp;</p>', '1 BLUE or 1 RED ', null, '', '2018-04-07 23:30:16', '2018-04-07 23:30:16');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (229, 'Side Plank Tree', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Side elbow plank on reformer. Be sure shoulder is over elbow. Feet on foot plate crossed at ankles top leg in front. Hand on hip.</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Lift top leg and place foot above or below supporting legs knee (never on the knee) &nbsp;Hold for 3 breaths.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Maintain good head neck and shoulder alignment.&nbsp;</strong></em></p>', '1 BLUE or 1 RED ', null, '', '2018-04-07 23:33:05', '2018-04-07 23:33:14');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (230, 'Booty Blast Pulses ', '<p><u><strong>Set Up</strong></u></p>
<p>Standing holding onto top of jump board or wall.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Legs together feet parallel rise up onto balls of feet. Demi squat. Squeezing adductors together. Pulse down and up x 10&nbsp;</p>', 'MAT ', null, '', '2018-04-07 23:46:27', '2018-04-07 23:46:27');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (231, 'Booty Blas Pelvic Tilt ', '<p><u><strong>Set Up</strong></u></p>
<p>Standing holding onto top of jump board or wall.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Legs together feet parallel rise up onto balls of feet. Demi squat. Squeezing adductors together tuck pelvis under and release. x 10&nbsp;</p>
<p><br></p>
<p><em><strong>NOTES; Maintain squat thoughout.&nbsp;</strong></em></p>', 'MAT', null, '', '2018-04-07 23:49:07', '2018-04-07 23:49:07');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (232, 'Booty Blast Leg Press ', '<p><u><strong>Set Up</strong></u></p>
<p>Standing holding onto top of jump board or wall.&nbsp;lean back elbows straight. Demi squat.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Lift single leg behind knee bent. Foot pressing towards ceiling. Pulse leg up x 10. Focus is in the Glute activation and maintaing suppoting leg squat.&nbsp;</p>
<p><br></p>', 'MAT', null, '', '2018-04-07 23:53:16', '2018-04-07 23:53:16');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (233, 'Booty Blast Sides ', '<p><u><strong>Set Up</strong></u></p>
<p>Standing holding onto top of jump board or wall facing side.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Lean in towards jump board or wall elbow may rest on jump board or wall. Demi squat lift outside leg. Pulse leg up towards ceiling keeping knee bent x 10&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; You may choose to repeat with a straight working leg.&nbsp;</strong></em></p>', 'MAT ', null, '', '2018-04-07 23:58:09', '2018-04-07 23:58:09');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (235, 'Box Pike', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Long Box next to reformer at foot bar end. Hands on eather side on box feet against shoulder rest closest to long box. Othside leg ontop clesses at ankle. Plank position.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare, Exhle lift hips towards ceiling bringing head inbetween arms. Inhale return to set up.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Initiate movement for abdominals.&nbsp;</strong></em></p>', '1 BLUE or 1 RED ', null, '', '2018-04-08 00:09:13', '2018-04-08 00:09:13');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (234, 'Scooter on Long Box', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Long Box pressed up against the side of reformer closest to jump bpard or foot bar.&nbsp;Standing on Long Box other heel against shoulder rest. Knees bent. Pelvis aligned. Hands on Foot bar jump board or behing back.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press heel into shoulder rest taking the hip into extension. Inhale return.&nbsp;</p>', '1 BLUE or 1 RED', null, '', '2018-04-08 00:02:28', '2018-04-08 00:04:42');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (236, 'Jump Leg Circles', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet parallel. &nbsp;Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale bend knees. Exhale jump circle legs around while in mid air. Alternate directions or stay the same.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-04-08 00:11:43', '2018-04-08 00:13:37');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (237, 'Jump Star Jumps ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in small V or parallel. &nbsp;Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale bend knees. Exhale jump into star jump while mid air.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-04-08 00:15:06', '2018-04-08 00:15:06');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (238, 'Jump Peter Pan ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine. Feet in small V. &nbsp;Arms by sides. Head rest comfortable or in a chest lift.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale bend knees. Exhale jump take one leg to the side, bend the other knee to the stag possition. Keep pelvis stable and neutral.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE You may choose Jump with chest lift&nbsp;</strong></em></p>
<p><em><strong>Curl head neck shoulders into chest lift. Inhale bend knees. Exhale jump. Place soft ball under upper thoracic if jumping in chest lift for extended&nbsp;</strong></em></p>', '1 BLUE ', null, '', '2018-04-08 00:15:41', '2018-04-08 00:16:28');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (239, 'Roll Back Round Back ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Seated on the edge of Reformer knees bent feet flat on the ground. Reaching arms out in front of shoulders.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare feel sitbones on the carriage. Exhale intitate roll back with a lumbur imprint roll back one vertebra to point of control. Scoop the low belly towards spine. Feet remain on the floor.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Putting a ball between the knees will deepen the core connection</strong></em>.&nbsp;</p>', '2 RED ', null, '', '2018-04-08 20:45:37', '2018-04-08 20:46:58');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (240, 'Roll Back Obliques ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Seated on the edge of Reformer knees bent feet flat on the ground. Reaching arms out in front of shoulders.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare feel sitbones on the carriage. Exhale intitate roll back with a lumbur imprint roll back one vertebra to point of control. Scoop the low belly towards spine. Feet remain on the floor.&nbsp;Hald way down reach single arm back to rotate thoracic spine and engage obliques. Inhale Return arms to front Exhale deepen core conection and roll back up. Repeat.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Putting a ball between the knees will deepen the core connection</strong></em>.&nbsp;</p>', '2 RED ', null, '', '2018-04-08 20:49:36', '2018-04-08 20:49:36');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (242, 'Spine Twist ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Supine on Reformer or Mat. Legs at table top hands holdinging onto pistons (foot strap rests beside head rest.) &nbsp;Gently imprint lumbar spine.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u>&nbsp;</p>
<p>Inhale rotate knees to side letting the pelvis lift. Try to keep knees flush. Shoulders remain in contact with the carriage or mat. Exhale deepen core connection bring knees back to center. This is a lumber thoracic rotation.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; To progress straighten legs. If on the mat have arms by sides.&nbsp;</strong></em></p>', '2 RED or MAT ', null, '', '2018-04-08 20:56:09', '2018-04-08 20:56:31');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (241, 'Pelvic Floor Activation ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Neutral spine supine on reformer or mat. Head rest comfortable. Arms by sides or resting on low belly. Feet on Foot bar or mat.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Feel spine long, allow the natural curves of the spine to be present. The ASIS and Pubic Bone align. Release low ribs, widen the collar bones. Inhale relax, feel belly rise. Exhale draw sitbones together, draw pubic bone towards tail bone. Inhale release. Exhale "lift" pelvic flooras though stopping a wee. Inhale relese.&nbsp;</p>
<p><br></p>
<p><u><strong>Progression to Core Activation</strong></u></p>
<p>Inhale relax exhale activate pelvic floor and &nbsp;cylindrically contract waist as though drawing a draw string tight around the navel. Inhale release. Exhale activate Pelvic Floor draw waist in and funnel low ribs down towards the navel. Inhale release belly. Exhale repeate the 3 steops to activate deep core. Keeping neck and shoulders relaxed.</p>
<p><br></p>
<p><em><strong>NOTE; There are many different ways to cue pelvic floor activation. Get creative and be sure to practice on yourself first.</strong></em></p>', '2 RED or MAT ', null, '', '2018-04-08 20:51:35', '2018-04-08 21:09:30');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (244, 'Pelvic Curl Glide ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Heels on foot bar. Spine neutral. Arms by sides. Head rest down.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale move through imprint, curl tail bone to pubic bone, pubic bone to navle roll up 1 vertebra at a time to T6.&nbsp;Glide pelvice to left then right come back to center and down one vertebra repeat till sacrum is in contact with the mat. Be mindful to keep pelvis level during glide.&nbsp;</p>
<p><br></p>
<p><strong>NOTE &nbsp;Be sure not to roll into spine extension. Sink the sternum lift the Pubic Bone.&nbsp;</strong></p>
<p><strong>Use the light spring setting for more hamstring connection, heavy spring for focus on spine articulation.</strong></p>', '3 RED ', null, '', '2018-04-08 21:49:14', '2018-04-08 21:49:14');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (245, 'Footwork Hip Circles ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Toes wide on foot bar knees in line with toes. Spine neutral. Arms by sides. Head rest comfortable.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Inhale to prepare. Exhale press toes into foot bar piviting on toes circle hips into internal rotation let knees come towards eachother as they straighten, externally rotale hips as knees bend back to starting point. &nbsp;After 10 &nbsp;hip circles alternate directions.&nbsp;</p>', '3 RED ', null, '', '2018-04-08 21:55:31', '2018-04-08 21:55:31');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (246, 'Elbows in Straps ', '<p>Set Up&nbsp;</p>', '3 RED ', null, '', '2018-04-08 21:57:24', '2018-04-08 21:57:24');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (247, 'Elbows in Straps Sides', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Elbows in straps (big loops) hands pressing up on knots. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Elbows pointing wide arms in goal post position.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u>&nbsp;</p>
<p>Inhale prepare exhale pull elbows down towards sides of ribs inhale elbows return to set up.&nbsp;</p>', '3 RED', null, '', '2018-04-08 22:05:15', '2018-04-08 22:05:15');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (248, 'Elbows in Straps Circles', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Elbows in straps (big loops) hands pressing up on knots. Spine neutral. Legs table top. Head rest comfortable. If the core is not strong enough lumbar spine can imprint otherwise neutral pelvis. Elbows pointing towards ceiling.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u>&nbsp;</p>
<p>Inhale prepare exhale pull elbows down towards ribs and circle out to the side inhale elbows return to ceiling. Alternate directions.&nbsp;</p>', '3 RED ', null, '', '2018-04-08 22:06:30', '2018-04-08 22:06:30');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (249, 'Feet in Straps Diamonds ', '<p><u><strong>Set up</strong></u></p>
<p>Supine. Spine and Pelvis Neutral. Feet in Straps at bottom of metatarsal arch. Head rest comfortable. &nbsp;Feet in V knees in like with second big toe.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Bend knees to diamond shape. Inhale keep diamond shape (knees bent) hinge at hips flexing hips. Exhale press back to set up position.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Maintain diamond shape thoughout. &nbsp;</strong></em></p>', '1 BLUE 1 RED or 2 RED ', null, '', '2018-04-08 22:11:21', '2018-04-08 22:11:21');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (250, 'Kneeling Arm Series Sides Single Arm Hug A Tree', '<p><u><strong>Set up</strong></u></p>
<p>Kneeling towards the side of carriage. Side Facing. Knees pelvis distance apart. Spine and pelvis neutral. Strap in hand closest to head rest.</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Both hands in second position (only one hand has the strap) exhale hug a tree inhale release.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Progression is to pull into thoracic rotation as hugging the tree.</strong></em>&nbsp;</p>', '1 BLUE ', null, '', '2018-04-08 22:12:14', '2018-04-08 22:16:19');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (251, 'Shoulder Press and Spine Extension ', '<p><u><strong>Set Up</strong></u></p>
<p>Lying prone on Long Box on Reformer. Hands on footbar shoulder distance apart. Legs together adductors active.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Exhale bend elbows wide coming into shoulder press, extend elbows. Inhale keeping elbows straight lifting sternum into spine extension. Exhale lower. Repeat.</p>
<p><br></p>
<p><em><strong>NOTE; Keep the movemnt fluid. Let the springs pull the body into spine extension keeeping elbows straight.</strong></em>&nbsp;</p>', '1 RED ', null, '', '2018-04-08 22:22:10', '2018-04-08 22:22:10');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (252, 'Breaststroke Long Box with Straps', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box legs stretched out long heels together or wide. Holding straps. Head towards foot bar. Foot bar down.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Both arms reaching past head. Elbows straight. Wrists shoulder distance apart. Circle arms around like breast stroke. Alternate directions.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE for advanced clients come into spine extension.</strong></em></p>', '1 RED +', null, '', '2018-04-08 23:05:38', '2018-04-08 23:08:05');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (254, 'Breast Stroke Long Box No Straps ', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box legs stretched out long heels together or wide. Head towards foot bar. Foot bar down.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Both arms reaching past head. Elbows straight. Wrists shoulder distance apart. Circle arms around like breast stroke. Alternate directions.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE for advanced clients come into spine extension.</strong></em></p>', '- ', null, '', '2018-04-08 23:09:01', '2018-04-08 23:09:01');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (253, 'Swimming Long Box No Straps ', '<p><u><strong>Set up</strong></u></p>
<p>Prone on long box legs stretched out long heels together or wide. Head towards foot bar. Foot bar down.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Both arms reaching past head. Elbows straight. Wrists shoulder distance apart. Lift opposite arm and leg. Switch.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE for advanced clients come into spine extension.</strong></em></p>', '-', null, '', '2018-04-08 23:07:54', '2018-04-08 23:09:11');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (255, 'Cat Stretch ', '<p><u><strong>Set up</strong></u></p>
<p>Four Point kneeling facing foot bar.&nbsp;Knees at front of carriage toes relaxed. Hands of footplate. armpits over wrists hips over knees. Tesion in the spring. &nbsp;Spine neutral.</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Exhlae spine moves into C curve flexion drawing belly to center pressing ribs to roof. Inhale move through neutral to spine extension opening chest.&nbsp;</p>
<p><br></p>
<p><u><strong>NOTE; Maintain tension in the springs holding knees and shoulders at 90/90 throughout the exercise.</strong></u>&nbsp;</p>', '1 YELLOW or BLUE ', null, '', '2018-04-08 23:15:06', '2018-04-08 23:17:54');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (256, 'Cat Stretch Leg and Arm Reach ', '<p><u><strong>Set up</strong></u></p>
<p>Four Point kneeling facing foot bar.&nbsp;Knees at front of carriage toes relaxed. Hands of footplate. armpits over wrists hips over knees. Tesion in the spring. &nbsp;Spine neutral. &nbsp;Foot bard down.&nbsp;</p>
<p><br></p>
<p><u><strong>The exercise</strong></u></p>
<p>Maintaining a neutral spine reach opposite arm and leg away from eachother. Maintain hips and shoulders at 90/90&nbsp;</p>', '1 YELLOW or 1 BLUE ', null, '', '2018-04-08 23:20:42', '2018-04-08 23:20:42');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (257, 'Long Stretch Tricep Dip ', '<p><u><strong>Set up</strong></u></p>
<p>Heels on shoulder rests toes on carriage in high heel position. Hands shoulder distance apart on foot bar.&nbsp;</p>
<p><br></p>
<p><u><strong>Exercise&nbsp;</strong></u></p>
<p>Press into extended plank. Exhale bring shoulders over wrists. Bend Elbows into Tricep push up. Inhale return to extended plank. Hips maintain position.&nbsp;</p>
<p><br></p>
<p><em><strong>NOTE; Modification bring knees down to carriage.</strong></em>&nbsp;</p>', '1 RED 1 BLUE ', null, '', '2018-04-08 23:29:36', '2018-04-08 23:29:36');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (258, 'Phoenix Warrior ', '<p><u><strong>Set Up&nbsp;</strong></u></p>
<p>Standing beside carriage. Single leg resting in high heel postition heel on shoulder rest. Arms by side.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u>&nbsp;</p>
<p>Inhale reach arms to ceiling to prayer position. Exhale bring arms to front of heart at the same time press the bed back into lunge chest comes to bent knee bringing hands either side of foot on floor. Maintain lunge reach arms up to ceiling &nbsp;into warrior 1 possition hold here for 3 breaths. Bring hands back down to either side of the foot. Chest to thigh. Straighten leg (supporting leg) and keep chest on thigh hold forward bend and take 3 breathes. Reach arms back up to ceiling roll up. Repeat 5 times. Then change sides.&nbsp;</p>', '1 RED ', null, '', '2018-04-08 23:40:49', '2018-04-08 23:40:49');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (259, 'Reverse Plank Inverted V ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Standing on footplate. Bring elbos to just infront of shoulder rests interlace hands and rest on head rest. Shoulders over elbows. Press into elbow plank.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare. Exhale lift hips to ceiling into inverted V. Inhale return to set up. Repeat.&nbsp;</p>', '1 RED ', null, '', '2018-04-08 23:44:12', '2018-04-08 23:44:12');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (260, 'Reverse Plank Knee Bends', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Standing on footplate. Bring elbos to just infront of shoulder rests interlace hands and rest on head rest. Shoulders over elbows. Press into elbow plank.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare. Exhale dip knees into well. letting carriage draw in. Extend knees and hips to set up position. Maintain plank thoughout.&nbsp;</p>', '1 RED', null, '', '2018-04-08 23:46:07', '2018-04-08 23:46:07');
INSERT INTO public.exercises (id, name, description, springs, photo, video, createdAt, updatedAt) VALUES (261, 'Reverse Plank Shoulders ', '<p><u><strong>Set Up</strong></u>&nbsp;</p>
<p>Standing on footplate. Bring elbos to just infront of shoulder rests interlace hands and rest on head rest. Shoulders over elbows. Press into elbow plank.&nbsp;</p>
<p><br></p>
<p><u><strong>The Exercise</strong></u></p>
<p>Inhale prepare. Exhale press elbows away in hale draw elbows back to set up. Maintain plank position. &nbsp;</p>', '1 RED', null, '', '2018-04-08 23:47:55', '2018-04-08 23:47:55');
